INSERT INTO `products` VALUES (1,'Hugeicons Pro | Beautiful Icon Library','https://public-files.gumroad.com/hywa7pmgoxfpu6zivr5omr6pxqqf',1,'Hugeicons Pro - your ultimate solution for top-notch, beautiful & consistent icon library. Crafted for designers, developers and content creators.\n Official website: Hugeicons Pro\nYou will get:\n\n 27,000+ icons | 57 popular categories (+growing)\n\n Stroke, two-tone, solid, bulk, and duotone icons\n\n Rounded & sharp icons\n\n Figma plugin & web app\n\n React library & popular JavaScript frameworks\n\n NPM\n\n Figma file\n\n SVG icons  in organized folders\n\n IconJar\n\n License KEY\n\n Life-time access (Free future updates)','https://halallalb.gumroad.com/l/hugeicons-pro?layout=discover&recommended_by=search',169,2),(2,'Myicons v1.34','https://public-files.gumroad.com/srw3plha8bie5d3kcgh1chn4vv52',2,'Myicons The World\'s Largest icons Pack\n\n15,000+ Premium high-quality vector line icons pack for professional websites & apps\n\nMyicons created to enhance any project you\'re working on. Doesn\'t matter if it\'s a website, a mobile app, or a slide deck.\n\nChangelog\n\n Free update every month  Growing pack\n\nMyicons  Standard License\n\nMyicons  Extended License\n\n15,000+ vector line icons pack, organized in 83+ categories\n\nWeights: Regular\n\nStroke: Live stroke,1.5px on a 24px grid.\n\n7 file types included: .Svg .Ai, .Pdf, .Png, IconJar, Sketch, Figma\n\nCheck out the full preview:\n\nIcons viewer\n\nbehance.net\n\n\n\n\nLike what we do? Don\'t forget to follow us on:\n\nDribbble|Behance| Instagram','https://lineicons.gumroad.com/l/myicons?layout=discover&recommended_by=search',135,2),(3,'Myicons v1.34 Extended License','https://public-files.gumroad.com/k5hmc3wsvz26637geciv6wk7jl2o',2,'Myicons The World\'s Largest icons Pack\n\n15,000+ Premium high-quality vector line icons pack for professional websites & apps\n\nMyicons created to enhance any project you\'re working on. Doesn\'t matter if it\'s a website, a mobile app, or a slide deck.\n\nChangelog\n\n Free update every month Growing pack\n\nMyicons  Standard License\n\nMyicons  Extended License\n\n15,000+ vector line icons pack, organized in 83+ categories\n\nWeights: Regular\n\nStroke: Live stroke,1,5 px on a 24 px grid.\n7 file types included: .Svg .Ai, .Pdf, .Png, IconJar, Sketch, Figma\n\nCheck out the full preview:\n\nIcons viewer\n\nbehance.net\n\nLike what we do? Don\'t forget to follow us on:\n\nDribbble|Behance| Instagram','https://lineicons.gumroad.com/l/myicons-extended-license?layout=discover&recommended_by=search',620,2),(4,'Anron Icons | Flexible Figma Icons','https://public-files.gumroad.com/p535j8ib1wjr7q0bg7sdaymhfkl1',3,'Massive update. Variants, new style, simplified icon structure, new categories, new icons, major website updates, and more. Check out the changelog for more details.\n\nFully customizable icon pack for professional web and mobile interfaces. Easily change the stroke weight, corner radius, or path of any icon in seconds. Without Illustrator, right inside Figma.\n\n5,000+ icons / 6 styles organized with Variants. In addition to the original Figma file, you also get an organized IconJar library as well as a clean SVG library.\n\nLearn more from the website ->\n\nTry and see the full preview ->\n\n\n\n\nFeatures Overview\n\nCreated in Figma from scratch and with love\n\n5,000+ icons / 6 flexible styles, 24px grid\n\nVariable stroke, elegant 1.5px by default\n\nVariable smooth corners\n\nFast switching between icon styles using Variants\n\nClean search results showing only Line icon style\n\nFlat and consistent icon structure powered by Vector Networks\n\nSaving color & stroke overrides when switching between icons\n\nSaving icon style when switching via the Instance menu\n\nBulk switching between icon styles (try Variant Switcher)\n\nBulk editing of stroke & corners (select with Similayer)\n\nFast library loading, whole package weight as 1 track on Spotify\n\nMost of the vector points in paths