nHome page  FAQ  Changelog  License  Request icon','https://dazzleui.gumroad.com/l/dazzleiconspro?layout=discover&recommended_by=search',32,2),(6,'The Icons 1.1.1  Finely-crafted. iPhone, iPad and Mac exclusive.','https://public-files.gumroad.com/lbmv9q65kox7m7lrxgudj2m4cmnu',5,'100% Complete set of redesigned Apple and third-party icons for iOS, iPadOS and MacOS\nCrafted with simplicity at its core, this exquisitely vibrant icon set blends the timeless elegance of Apple\'s classic design with a fresh, contemporary twist.\nFrom the iconic Finder to lesser-used ones such as ColorSync Utility, and even for apps you might not have known Apple offers, like Classroom.\n\n\n\n\nVisit project\'s website\n\n\nIMPORTANT:\n\nAfter completing your purchase, you will gain access to all future app icons (both Apple and third-party) in this set without any additional charges.\n\nYou also have the opportunity to prioritize and recommend the next icons you wish to be included in the set.\n\n\n\n\nFEATURES:\n\n100% complete set\nAll Apple app icons for macOS, iOS and iPadOS\n190+ icons and growing\nRedesigned from scratch\nHigh resolution\nVector-based, PNG format, 1024x1024 px\n2 aesthetics\nChoose between squircles and circles\nRegular updates\nEver-growing icon set\n\nIcon requests\nRecommend the next icons\n\n\n\n\nWHAT\'S NEW:\n\n\n\n\n\nv1.1.1\n\nAdded 10 new requested third-party icons\n\n\n\n\n\nv1.1.\n\nAdded an icon for the Apple Sports app\n\nAdded 50+ new third-party icons, including some alternatives.\n\nImproved shadows and gradients on various icons\n\nNew circular icon for BootCamp Assistant\n\nNew circular icon for Time Machine\n\nUpdated the Disk Utility icon\n\nUpdated circular icon for FaceTime\n\n\n\n\n\nv1.0.\n\n120+ redesigned Apple app icons for iOS, iPadOS and macOS\n\n\n\n\nFOLLOW ME ON INSTAGRAM AND X (TWITTER)\n\nUse #theicons tag on social media or send a screenshot of your setup to make it to the featured section on the project\'s website.\n\n\n\n\nFOR 