reliable but also be friendly and approachable.\n\nWhat makes Spotless unique?\n\n Focus on quality rather than quantity; every icon is a distinct pictogram.\n\n A delicate balance between lines and fills and a subtle hint of 3D.\n\n Designed upon a shared visual language.\n\n Features strong and sometimes unconventional visual metaphors.\n\n Evokes quirky and friendly but also stable and reliable feelings.\n\n Comes with a promise that you wont find it in any heavily discounted bundle.\n\nView Figma preview\nWhy should I buy premium icons?\n\nA solid icon set is like a microcosm of your brand.\n\nThere is a multitude of free icon sets available on the interwebs. But precisely because they are free, they are used by millions. Ive heard clients say, Oh, Ive seen this icon set. Its from [icon store]. You can download it for free.\n\nYou dont want your customers to say that to the icons on your website. They might perceive your brand as cheap, and unreliable.\n\nPremium icons, on the other hand, bring more exclusivity to your projects since they are not available, nor affordable to everyone. And I try to control that by keeping the price on the high end, which tends to attract smaller, but more loyal customers, using the icons more intentionally.\n\nWith my combined effort of being a bit exclusive and giving a creative emphasis on more expressive iconography, I bring forth pictograms that feel custom-made, yet are still applicable to most brands.\n\nHowever, if you truly want to go custom and hold an exclusive license, Id be happy to make custom iconography for your brand.\n\nCommon questions\n\n What file types do I get?\nSVG, PNG, Figma, and Iconjar. Need more? Write to me and I might consider adding more.\n\n Whats the canvas size?\n6464 pixels, with a safe area of 4 pixels around the edges.\n\n Can I tweak the line thickness?\nDue to the nature of the iconsbeing a mix between lines and fillsall icons are outlined, and you cant tweak the line thickness.\n\n Will I get a discount?\nSince youve reached here, psst each subscriber gets a voucher for a tiny discount. So, make sure you subscribe to my shop.\n\n In what ways can I use the icons?\nThe purchased icons come with the Standard license. If you need more legal freedom (such as using the icons in a product for sale) please refer to the Extended license.\n\n Why are you not offering a subscription?\nI believe in a straightforward approach. Although subscriptions might be more lucrative in the long for me, it creates an utteranceAh, forgot to cancel my subscriptionevery year for you. I want to avoid that.\n\n Do you offer a refund?\nUnfortunately, due to the nature of the goodies being digital, I cant provide a refund.\n\n How will I get notified of future free updates?\nIll send you an email after each update. If you miss it, just go to your Gumroad Library (if you created an account when you purchased the icons) or find the original email receipt that you receive upon purchasing the icons.\n\nStill having questions? No worries. Im an email away.\n\nPast updates\n\n Sep 28, 2022\nOfficially launched version 1 of Spotless icons with 500 icons strong.\nRead update \n\n Aug 24, 2022\nReleased the third batch of 100 icons during a presale stage, amounting to 300 icons at a 40% discount, limited to 60 seats.\n\n July 4, 2022\nReleased the second batch of 100 icons during a presale stage, amounting to 200 icons at a 60% discount, limited to 40 seats.\n\n Jun 15, 2022\nReleased the first batch of 100 icons during a presale stage, at an 80% discount, limited to 20 seats.','https://pixelbazaar.gumroad.com/l/spotless?layout=discover&recommended_by=search',50,2),(63,'iPhone Line App Icons Pack','https://public-files.gumroad.com/dtn5018nuy4r7f31xiw2s8ccwcsy',54,'A set of line app icons that can be used on iOS and Android. But mainly designed for iOS. Pack currently contains over 90 icons per each style.\n\nDo you miss any icon? Contact me and I will add it in future updates.\n\nWallpaper