ace, Tome Sans does not bring attention to itself. It is not a typeface that subscribes to trends; rather, it is a more timeless design.\n\nTome Sans has a range of 10 weights from ExtraThin to Black with companion italics and boasts a Latin Plus glyph repertoire of over 860 glyphs. Among those glyphs are several sets of numerals (including Tabular and Oldstyle figures), arrows, and a trove of letters spanning several complete Unicode ranges supporting over 220 languages. In addition, a host of thoughtful but unobtrusive OpenType features are built in and ready to assist with setting your composition. Give Tome Sans a spin; youll agree this family is a valuable typographic toolset for any designer.\n\nMore about Tome Sans at Delve Fonts\n\nMore buying options for Tome Sans\n\nSign up for our newsletter','https://delvefonts.gumroad.com/l/tome_sans_family_app?layout=discover&recommended_by=search',999,4),(311,'ZT Bros Oskon 90s','https://public-files.gumroad.com/2ti7t6sdhhspjgdmkszerh6sbp2e',175,'ZT Bros Oskon 90s is a captivating typographic creation that seamlessly blends the aesthetic charm of the 1990s retro era with a modern touch. With unmatched serif elegance and a unique 90s style, this font offers 72 variations, including sharp condensed forms, graceful expansions, and captivating italic styles.\n\nEvery character in ZT Bros Oskon 90s is meticulously crafted, creating a vintage ambiance that is truly enchanting. Featuring 6 font weights ranging from Extra Light to Bold, this font provides you with the flexibility to create a wide range of striking and memorable designs.\n\nFeatures of ZT Bros Oskon 90s:\n\n72 Unique Variations\n\nAesthetic Retro Vibes from the 1990s\n\nElegant Serif Style\n\nCondensed, Expanded, and Italic Forms\n\n6 Font Weights: Extra Light, Light, Regular, Medium, Semi-Bold, Bold\n\nExceptional Creative Versatility\n\nZT Bros Oskon 90s is the perfect choice for graphic design projects, branding, posters, and other promotional materials tha