ur ideas, Collidge is for you. Get ready to make some noise and take your designs to the next level!\n\n\n\n\nWould you like to get 5 completely free fonts worth over $75? No tricks, no hidden words, terms or anything. Just subscribe to my newsletter, make sure to check your email to approve the subscription, add me to your contacts so that the emails don\'t end up in spam folder and you will get 5 fonts for free. The fonts are packed with alternates, ligatures and some even come with extra goodies.\n\nhttps://view.flodesk.com/pages/63594052b967a943dd6cc528\n\nHappy creating everyone!','https://silverstag.gumroad.com/l/collidge-bold-ligature-rich-sans-serif-font?layout=discover&recommended_by=search',24,4),(343,'Soul Font','https://public-files.gumroad.com/7b9j2syq25nccs81vklbnsvest5k',181,'26 PNG Images (Transparent Background)\n3000x3000 px, 300 dpi\n\nPersonal & Commercial Projects','https://grafikonelu.gumroad.com/l/soulfont?layout=discover&recommended_by=search',25,4),(344,'Lucifer Family + Variable','https://public-files.gumroad.com/gsyebf5kp61f5365m54ugn11a7og',179,'Lucifer features contemporary aesthetics while being deeply rooted in a lesser-known part of Swiss design history. The typeface has an almost menacing appearance. Its sharp, expressive serifs and overall organic look are inspired by the hand-lettering of Swiss designer Robert Stcklin in his poster for the Schweizer Mustermesse Basel in 1924.\n\nWhile Lucifer takes many of the unique visual qualities of its historical reference material, it is also optimised for the demands of contemporary design professionals. Its expressive aesthetic excels in wordmarks, headlines, and poster designs. At the same time, the type system works just as well in various kinds of running text, which makes it a respectable, unique workhorse type family.\n\nThe type family consists of 8 cuts, which are Regular, Medium, SemiBold, and Bold accompanied by their respective italics. In addition, it supports a wide range of Latin-based languages, including Vietnamese and Standard Mandarin Chinese via the official romanization system Pinyin to ensure the usability of the typeface in a broader international context.\n\nThis typeface was funded by Pro Helvetia, Swiss Art Council.\n\nSpecimen (PDF)\n\nSave 37,5%compared to buying all styles separately and getthe variable font fileson top!\n\nWhat do you get?\n\n The latest font file(s) of the styles Regular, Regular Italic, Medium, Medium Italic, SemiBold, SemiBold Italic, Bold, Bold Italic + Variable Font.\n The selected licence\n A specimen of the typeface (PDF)\n\nCan I try the font before buying?\n\nOf course, you can! We offer trial versions of all our typefaces.\n Trial Fonts\n\n\n\nWhat about updates?\n\nIf you bought a licence, you will always be able to download the latest version of the font free of charge with the download link provided after your purchase, so keep it safe.\n\n\n\nHow does the licencing work?\n\nPlease be aware that all licences offered here are standard licences. If you want to use the font(s) for private, for-profit entities with more than 250 employees, please contact us to request an extended licence.\n\nThe desktop licence allows font files to be installed on a specified number of personal computers (PCs) belonging to the licence holder to create documents, static images, logotypes, and such.\n\nThe web licence allows font files to be embedded via self-hosting and @font-face technology into a single website belonging to the licence holder to display it for a specified, number of monthly page views (MPV).\n\nRead the full licencing details to ensure legal usage of the provided font files.\n EULA\n\nFollow us for news, insights, and our latest projects:\n Newsletter\n @t.m.hoangnguyen\n @david.gobber','https://nguyengobber.gumroad.com/l/lucifer-family?layout=discover&recommended_by=search',400,4),(345,'Chonk','https://public-files.gumroad.com/1nz9zb4r068op7lhgicsql1upkwr',192,'Chonk is a heavy display sans that likes to take up space. Its best used in moderation, when you want to be LOUD. The inspiration came from playing with my kids Play-Doh extruder, and seeing how much clay we could cram into the molds. I wanted to make atypefacethat tried to expand to fill its container in the same way, which is why theres a slight convex touch to the verticals: the whitespace pushes out, while the letters push back.\n\nThe character set is minimal right now, but Id like to keep expanding it. Ill pass along any updates I make to the character set for free. If you need anything specific, email me and Ill try and help.\n\nThis is a desktop and web license for 1-3 users, personal or commercial (with some limitations for larger companies and sites). Read the full EULA.\n\nFor ebooks, higher limits, larger commercial use, or any other specific needs, email me and well work it out.\n\nThanks! ','https://jasonsantamaria.gumroad.com/l/chonk?layout=discover&recommended_by=search',10,4),(346,'Morganite Free Typeface','https://public-files.gumroad.com/friii7esnnp1s7p14066cc658m23',171,'Morganite is a free typeface with 18 styles from Thin to Black. The typeface is free to use for personal and commercial projects.','https://rajputrajesh-448.gumroad.com/l/jPYXU?layout=discover&recommended_by=search',0,4),(347,'Baru Sans Geometric Font Family','https://public-files.gumroad.com/id106xgayupps7k5gkp5frpx11r3',193,'Baru Sans is a geometric typeface that strikes a balance between the precision of geometric foundations featuring chopped terminals with distinctive 90 strokes to reinforce design aesthetics. Moreover, the italic version of the Baru Sans font embodies a humanist style inspired by handwriting.\n\nThe term \'Baru\' translates to \'new\' or \'fresh,\' reflecting the font\'s aim to set unprecedented design trends. With 9 weights, including upright italics and true italics, the total of 18 fonts offers flexibility for various applications in typographic design. These weights range from the precis