fvofrshjzflz6aop8q1esi',217,'Hello! These are my worksheets to help you learn cursive handwriting. This is my style of cursive writing. This set includes majuscules (capital letters), miniscules (lowercase letters), numbers and a few punctuation marks so that everything matches.\n\nIf you need more practice, the \'Words and Flourishes\' may come in handy.\n\nI hope you find this useful and enjoyable.\n\n\n','https://prettyincursive.gumroad.com/l/izvcv?layout=discover&recommended_by=search',20,4),(404,'Unique','https://public-files.gumroad.com/nwgl56jfevun2xwyf34q3e9cf2e8',171,'Unique is a charming rounded typeface. If you have seen my other typeface Humane, this is the rounded version of that, with some alternate characters as an open type feature.\n\nUnique has seven weights, from Thin to Bold, supporting multiple Latin languages. It has its own delightful personality and will be the right choice for  Bold Titles, Logos, Headlines, Posters, etc.','https://rajputrajesh-448.gumroad.com/l/Unique?layout=discover&recommended_by=search',0,4),(405,'The Lost colors','https://public-files.gumroad.com/acdn990t810bt6kobhfqwmiuv1kt',218,'Children\'s book, about the power of words.\nWhy colors could disappear? Come along on the journey of The Lost Colors, with Layla, her family and friends. They are looking for the the lost colors.','https://hanibiarie.gumroad.com/l/nggpjo?layout=discover&recommended_by=search',22,3),(406,'Founders\' Day: a story by Arzhang Zafar','https://public-files.gumroad.com/gi1f998n0y9p9cncyvphle3r55po',219,'Available NOW. For wholesale purchasing, contact us directly at bruiser.magazine@gmail.com\n\nOn a day like any other, Neil receives a devastating communication: he has been selected to participate in his town\'s annual Founders\' Day Game, a compulsory fight to the death between two citizens. Will Neil stoically face near-certain death, or will he manage to find someone else to take his place?\n\nThe third volume in the BRUISER Zines series, Founders\' Day is a short story by the Philadelphia writer Arzhang Zafar, whose previous work can be found in BRUISER and Apocalypse Confidential. Printed and assembled in Baltimore with art by Jun Wilkinson, this limited edition zine is a pitch-black social satire of the arbitrary violence endemic to fascist culture.\n\n\"Founders\' Day conjures an Omelas-dystopia through the lens of the now infamous tweet, \"Why do we...never question if the child has bad vibes?\" Arzhang Zafar\'s dry wit paints the unflattering image of a man, more cockroach than human, desperate to survive within the very community which has nominated him to fight for his life. This dystopic satire explores a rampantly unjust system of capital punishment, where the reader reckons with a disturbing question: is it carceral-minded to be happy when your personal enemies meet an untimely demise?\"\n\n- Jane DIESEL\n\n\"Zafars wit trickles into plain language at a methodical pace. You can sense him smirking as brutal absurdity first punctures the seemingly banal suburban world of Founders\' Day, inducing the shock-turned-odd-bliss of the best surreal fiction. If someone told me theyd run out of Kafka to read, or wanted something DeLillo-y they could start and finish on their lunch break, Id tell them to read this.\"\n\n- Jake Symbol\n\n\"Like Clive Barker\'s In the Hills, The Cities had a baby with The Hunger Games and then the baby was raised by The Ones Who Walk Away From Omelas, Arzhang Zafar\'s Founders\' Day explores how our desire to be loved is nothing more than a symptom of our fear of death, and how this same love is used as a weapon.\n\n- David Simmons','https://bruiser.gumroad.com/l/foundersday?layout=discover&recommended_by=search',10,3),(407,'Foul Black Rookeries - stories by David Simmons','https://public-files.gumroad.com/lhi7tanqb4x4fd1ixf0sgpisehlt',219,'Copies should start shipping on or around May 24. For wholesale purchasing, contact us directly at bruiser.magazine@gmail.com\n\n\"Welcome to the lore of David Simmons: four stories that read like a lost history of Baltimore, drug users staring into the uncanny, an apocryphal account of those in the trenches. These are ordinary people butting up against extraordinary circumstances; theres emotional weight and prose that cuts like a knife while dripping style. This is David Simmons world, were just lucky enough to live in it.\"\n\n-- Justin Lutz, author of Gemini Rising and Gone to Seed\n\nThe fifth volume in the BRUISER Zines series, Foul Black Rookeries is a collection of four stories by Baltimore writer David Simmons. Printed and assembled in Baltimore, this limited edition zine is a startling portrait of Baltimore as seen through Simmons\' grimy lens, taking the warts-and-all approach of crime fiction and pushing it somewhere stranger and more terrifying.\n\n\"Simmons is a chameleon of prose, slipping into the minds of his characters and the landscapes of his bizarro Baltimore with ease, imbuing each story with a profound authenticity borne not only from an attentiveness to the world, but even more so a clear and ineffable passion for the inner workings of things--whether they be fantastic biologies or makeshift weapons or philosophical frameworks. It\'s all as real as it is surreal.\"\n\n-- Arzhang Zafar, author of Founders Day\n\n\"David Simmons is the Joyce Carol Oates of Charm City.\"\n\n-- Brian Allen Carr, author of Opioid, Indiana and Bad Foundations\n\n\"David Simmons is the most exciting, wildest writer I\'ve come across in years.He\'ll make you wince from horror, laugh from dialogue, and then, when you\'re distracted by eldritch gods and conceptual madness, he\'ll emotionally gut you. One of the very best.\n\n-- e. rathke, author of Howl and Glossolalia\n\n\"Foul Black Rookeries is a small collection of short stories with a brilliant yet uncompromising imagination and colossal prose. Youll find an intermingling of urban grit with old school horror sensibilities that only Simmons could cook up. These stories will cut you with a surgeons precision and unearth emotions you didnt even know were lying dormant.\"\n\n-- Grant Wamack, author of Bullet Tooth\n\n\"David Simmons burst on the scene with a voice so confident and precise that he must have honed it in a past life. He will be one of the greats. I have no doubt about that.\"\n\n-- J. David Osborne, author of Dying World and War in Heaven\n\n\"Not since Vonnegut has there been a more distinct and perfect alchemy of absurdism, heart, and intellect than in the work of David Simmons.\"\n\n-- Kelby Losack, author of Mercy and Letting Out The Devils\n\n\"Simmons replicates the experience of stress into a surrealism of violence. Not a portrait of evil but of its consequences.\"\n\n-- O.F. Cieri, author of Backmask','https://bruiser.gumroad.com/l/foulblackrookeries?layout=discover&recommended_by=search',10,3),(408,'Saturn Returns: a mixed-media poetry zine by Ashley E Walters','https://public-files.gumroad.com/4o2vjzqgod04xc10p2qdt80z1kid',219,'Available for preorder NOW. Copies should start shipping on or around April 26. For wholesale purchasing, contact us directly at bruiser.magazine@gmail.com\n\n\n\n\nI wrote this on a scrap of paper while eating an apple:\nIf I collect up all the images and thoughts and fears from my everyday life and mind and put it all together, will it tell me something? Will it give me a sign? I would like to pour my heart into the embodiment of the Paris, Texas monologue, but instead of separated lovers, its me trying to poeticize the detritus in my brain and I cant quite see who I am talking to.\n\nGoogle searches are poems. Spam emails are poems. Being lost is a poem. Everything reflects some part of me back to myself. Its all kind of embarrassing.\n\nThe images and texts in Saturn Returns chronicle a strange time when Saturn re-entered the place it was at my birth, a difficult period of a few years that most astrologers believe to be the hallmark of adulthood. This doorway also acted as a mirror, one that reflected my utter confusion, moments of scrying at divinity, a war with my body. Filled with yearning and uncertainty, images from everyday are stacked and arranged to approximate a poem. From this arrangement comes another poem. They reflect back at each othertrying to understand.\n\nThe fourth volume in the BRUISER Zines series, Saturn Returns is a mixed-media collage of phone screenshots, photos, found images, and poetry by the Los Angeles-based artist and writer Ashley E Walters. Printed and assembled in Baltimore, this limited edition zine is an intimate, bittersweet meditation on the small moments and questions that accumulate over the course of existing in a mundane-yet-complex world.\n\n\n\n\n\nPOV: youre spending one golden afternoon, or maybe one manic morning or one cool neon night in Ashley E. Walters eyeballs seeing what shes seeing, scrolling what shes scrolling.\n\nPOV: you just picked up Saturn Returns. This deft collection of poem-image-poems gives you the uncanny and sublime sensation of stepping into Walters skin and holding in your/her hand your/her cellphone and generating questionable google search histories via stream-of-consciousness-intrusive-thought search sprees. The barrier between image and poem dissolves as does the boundary between worlds outside and inside the phone while you hold it up to take a photo and receive a text containing a screenshot of a camera roll. Real ones will know the phone world is the real world, too. Real ones will step out of Walters\' skin with a new-found appreciation for the poetry easily discovered on daily walks and in spam email folders. Needless to say: Ashley E. Walters is a Real One.\n\nSide note: I really want that hat. Youll know which one I mean.\n\n-- Anna K. Crooks, author of girl poems\n\n\n\n\n\nIts hour 5 of a 7 hour road trip. You look out the passenger side window. The land is flat and your eyes are starting to hurt. Ashley E Walters is driving. If you remember being 29, youre starting to cry. Frenetic and unafraid, Saturn Returns is overwhelming in its ability to rescue the sublime from the mundane. Presented in two parts, two wholes, one hand steals images and the other holds open tabs. This work is not done lightly, but wryly, reveling in the absurdities that knock a body from (too much) despair. A masterful work.\n\n-- Devlin Grimm\n\n\n\n\n\nSaturn Returns presents the fluidity of mind-wandering and universality of strangeness one experiences when conducting deep introspection during a pivotal time period. Walters invites us into intimate scenes from her everyday life, experimentally layered, in image and text. We relish recent queries and glance through the rear window of her car. Walters gives space to the small moments that amount to monumental symbols of love, advice, longing, humility, recognition, and poignant absurdity. The presence of light gleams, is in transit, and is fleeting as Walters photographs and poems act as a mirror and at times a shadow of the real body.\n\n-- Ellen Phillips\n\n\n\n','https://bruiser.gumroad.com/l/saturnreturns?layout=discover&recommended_by=search',10,3),(409,'By the Horns','https://public-files.gumroad.com/s0g96tqs61ocrk6am23pa97cahti',220,'On vacation in Crete, a woman discovers unconventional ways to escape her dying marriage.\n\nElena Ferrante colliding with the fantastique.\n\n32 pages, PDF.','https://astridannerose.gumroad.com/l/by-the-horns?layout=discover&recommended_by=search',5,3),(410,'Cereus & Limnic: Definitive Collection','https://public-files.gumroad.com/sersamkpoyj72w4a7ca3pmnu9kcy',221,'\n\n\n\n\n\n\nA military science fiction story with big ideas, Cereus & Limnic tells the story of two rival organizations locked in a bitter struggle for the future of humanity.\n\nOne conflict will decide the fate of millions in this spectacular work of fiction.\n\nThis book will guide you to greater insight about human society and how to change it for a brighter future.\n\nWhat You Get:\nCereus & Limnic (Novel Only)\n\n An electronic copy of the Cereus & Limnic novel (495 pages) ($20 Value)\n\n\n\n\n\nCereus & Limnic: Definitive Collection\n\n An electronic copy of the Cereus & Limnic novel (495 pages) ($20 Value)\n\n 67 episodes of the Cereus & Limnic Audiodrama Podcast (AD-FREE, REMASTERED) in mp3 format (21 hrs 17 mins of audio) ($30 Value)\n\n DLC STORY: Operation Silent Thunder The Legend of Cheeks (7500+ words) ($10 Value)\n\n 28 Original songs (1 hr 40 mins of music) ($20 Value)\n\n Mini- Documentary: One Man Show - Making of Cereus & Limnic ($30 Value)\n\n 21 Pieces of original story artwork ($30 Value)\n\n 20 Episodes of Cereus & Limnic: Behind-the-book Podcast (mp3 files) (6 hrs 11 mins of audio) ($30 Value)\n\n Instant access to Cereus & Limnic: Circular Dungeon Room (Game) ($10 Value)\n\n Instant access to Sci-fi Color Battle (Game) ($10 Value)\n\n Audio log - Plans for Cereus & Limnic 2 and 3 ($10 Value)\n\n\n\nCereus & Limnic: Definitive Collection + Video Novel\n\n Everything in Cereus & Limnic: Definitive Collection\n\n 21+ hrs of video\n\n 60+ story images\n\n 8 YouTube videos with the full story\n\n\n\nOperation Silent Thunder: The Legend of Cheeks (DLC ONLY)\n\n DLC STORY: Operation Silent Thunder The Legend of Cheeks (7500+ words) ($10 Value)\n\n','https://khayden22.gumroad.com/l/cereus-limnic?layout=discover&recommended_by=search',9,3),(411,'Those Wyrd and Wonderful | Paperback','https://public-files.gumroad.com/2xwq7b0bojdegd6pafu39ggr1mr2',222,'The gods shake their snow globe and chuckle, for the world was not always silent and still.\n\nFor those interested in stories about a bunch of misfits who regularly confront the supernatural, fighting to become more than pawns between the games of cosmic horrors. Their company struggles against insurmountable odds, trauma and turmoil which cultivate in their own anxiety-riddled adventures. Magik often draws the ire of ruinous powers, and in a world where isolated frontier towns are crushed by relentless torrents of snowfall, vagabonds take all the help they can get, lest be wiped off the map. The events in my novel start similarly to the Klondike Gold Rush, as pioneers attempt to tame the unbound wilderness. Those at the mercy of the weather quickly discover fate pulling their strings, and beasts nipping at their heels, goading them further into the fray. In a world so untamed, everything may seem bleak and dismal, but there is still much joy in the world, hidden to all those too bitter or driven to drink. Whether we find love in our hobbies and craft, or each other, there is always balance, our light to guide way through the dark. Unofficially, my recipe is one part sour, one part sugar, stir, and lastly, top it all off with a pinch of existential dread.\n\nAfter the earth froze over in a great cataclysm, humanity took to the old citys underground tunnels and survived the chill like vermin. Hundreds of years later, as the clans continue to clash over heat and scraps, people decide to test their mettle by reclaiming the world above only to discover that these lands rally against them by manner of tooth and claw.\n\nWilliam is one of those second-generation pioneer kids whod rather forfeit his daily drudges than compete against those vagabonds racing to stake their claim. Alas, as the barrowtide season bears the brunt of bad weather, his frontier settlement is deemed just another lost cause. The young boy Jones is forced into a harsh reality, coming to terms on whether hell sink or swim, cast against an ever-rising white tide and the dark secrets harbored there.\n\nDealt a bad hand, William faces a hostile world where honest threats are always looming against him. Those Wyrd and Wonderful showcases the grim decisions of frontier life, because to thrive, one must first survive. An earnest lad learns to roll with these punches, neither losing his compassion, nor those morals while countless others around him have chosen to forget.\n\nAbout the Author\n\nA little bit about me, Im a central Ohio native who has always been immersed in storytelling, studying art, design and all things creative. I earned my Bachelor of Fine Arts in Animation from the Columbus College of Art & Design. My professional background for awhile was in social media, where I managed accounts for a reality enterprise, art community, and several start-ups. Afterwards, I became an aquarium technician, visiting homes to take care of clients fishtanks and ponds. Then I decided to get out of the city, move to a small town, and kickstart my career as a writer.\n\nMy work details a world cast with rime, filled to the brim with unconventional creatures and drama, theres a little something for everyone in his novels. I feature an eccentric slew of characters and down-to-earth grit, where those fictional few are spurred on a path of pure, unadulterated adventure, traversing untamed wilds, and confronting their harsh realities.\n\nI do have a separate book which I self-published but never really marketed, titled A World of Honest Threats, which introduces the icy narrative. Its designed as a world-building book for D&D fans, detailing just what it takes to survive in my fictional winter wonderland. What sort of menagerie should navigators expect? Well, theres the burly bison, timid troll-kin, those particular gremlins led by their pompous kit-king, and even that dreaded tundra terror who all have their parts to play. In a certain twist of events, I actually created my world first. Now Im writing the tales of those who live it, and it all begins with this debut novel, Those Wyrd and Wonderful, the first of many more to come.\n____\n\nEmail me at marketing.trentlindsey@gmail.com with any questions.','https://honestthreats.gumroad.com/l/wyrd-and-wonderful?layout=discover&recommended_by=search',15,3),(412,'A Well Moderated Evening & Other Rambunctious Short Stories','https://public-files.gumroad.com/j9shle05dx1f7gmwyi7x2bj1wu2u',223,'Memorable, thought provoking, downright mad.\n\nThese are not bedtime stories.\n\nIn a time of blatantly recycled ideas, these new stories are a breath of fresh air.\n\nThey are safe to read, but it is the author\'s hope they are not. A few of these push the envelope and hopefully get labeled dangerous to read (what phenomenal marketing that would be!)\n\n10 Short Stories with big ideas on murder, simps, weebs, grief, wellness gurus, pets, doctors and more.\n\nDark and satirical, these stories pay homage to the original comedy, the tragedy.\n\nYou\'ll wonder if these stories are true, if they really could have happened?\n\nYes! Each story is based on real events, their absurdity as a story only hides the madness of the world.\n\n\n\n\nThe 10 Stories Are:\n\n-Doctor Influenza\n\n-The Local Hero\n\n-2D LOVE 2DIE FOR\n\n-Feline Superiority\n\n-Symbiotic Purpose\n\n-Bark for Help\n\n-The Moths\n\n-Street Glamping\n\n-The Jeff Reality\n\n-A Well Moderated Evening\n\n\n\n\n\nQuick and entertaining reads that will leave you wondering where the lines between art and reality blur.\n\nFor a refreshing bit of entertainment click the purchase link to your right!','https://amrengifo.gumroad.com/l/AWellModerateEvening?layout=discover&recommended_by=search',19,3),(413,'Twilight Monk: Books 1 and 2 (ILLUSTRATED NOVELS) PDF download','https://public-files.gumroad.com/645xz9c0goj6mdgivkejr9brg1y6',224,'Available in paperback and kindle on Amazon.\nhttps://www.amazon.com/Trent-Kaniuga/e/B0069989M2%3Fref=dbs_a_mng_rwt_scns_share\n\nRead up on the origin story of Twilight Monk before the Video Game! (currently in development)\n\nIncludes:\n\n-Books 1 and 2 in pdf format.\n\n-Over 100,000 words. Over 70+ illustrations and sketches by the author.\n\n-World of Twilight Monk (art book) preview\n\n-Includes wallpaper jpegs\n\n\n\n\nWritten by Trent Kaniuga and Chris Krubeck\n\nArt by Trent Kaniuga and Danny Kong\n\n\n\nIt is a desperate time in the land of Speria. Rumors of villages destroyed by Dark Creatures echo across the land. The downtrodden survivors turn to the remnants of Moonken warriors at Crescent Isle, but their pacifist ways do not allow them to intervene.\n\nRaziel Tenza and Rin Torra are likely the worst Moonken to ever train at the monastery on the mystical shores of Crescent Isle. But when an insurgent gang of miscreants (The Red Cobras) threaten to run them out of town, they decide to team up and stand their ground. The only problem is... they stink at kung fu!\n\nWith no fighting ability whatsoever, (but a whole lot of gusto!) they embark on an epic martial arts adventure in search of a shortcut to the ultimate badass Kung Fulio power of their ancestors. In their desperate struggle, they accidentally unleash raging Darksprites, get wrapped up in a legendary mystical heist, and discover secret powerful artifacts that will shape their destiny, and determine the fate of the Monks of Twilight.\n\nTwilight Monk is a series of Kung Fu action-adventure fantasy novels.\n\n\n\n','https://trentk.gumroad.com/l/TfXKo?layout=discover&recommended_by=search',5,3),(414,'Foundling','https://public-files.gumroad.com/jxznj2hi4itgepvgvehmtg1hce44',220,'A werewolf gains an unexpected companion.\n\nInspired by relevant work by Tanith Lee (as always) and Melanie Tem.\n\n10 pages, PDF.','https://astridannerose.gumroad.com/l/duvsg?layout=discover&recommended_by=search',1,3),(415,'Fata Morgana','https://public-files.gumroad.com/lrycy6usz7f7kzlnnhpjn35p2l9v',220,'An echo of religious violence from the past inflicts itself on a girl in the present.\n\n15 pages, PDF.','https://astridannerose.gumroad.com/l/nCDxk?layout=discover&recommended_by=search',1,3),(416,'La Porte du Roi : Libert Entrave - livre audio','https://public-files.gumroad.com/llb8tj2zz5ghdhll5akcxjqvrp3h',225,'Prisonnire de sa vie et de sa caste, Ehsan porte la terrible marque de lesclavage depuis ses huit ans. Servante au palais royal, son quotidien est rythm par les injustices qui la rvoltent. Mais une femme de sa condition peut-elle y changer quelque chose ?\n\nDans la capitale dEln, la vie nest belle que pour les nobles. Au service du prince hritier Shahin, elle saperoit quelle nest pas la seule  souffrir et  dsirer que le monde change. Elle remarque en ce prince les prmices dun grand souverain. Peut-elle vraiment lui accorder sa confiance et sa loyaut ?\n\n\n\n\n\n','https://lisaschneiderauteur.gumroad.com/l/xAHyA?layout=discover&recommended_by=search',20,3),(417,'How I Found Her','https://public-files.gumroad.com/br1b49y6hx6wbhj4af7007kesenb',226,'Jen lost her job and her husband (and the contents of their joint bank accounts) in the same week, going from wealthy to working class overnight. Struggling to make ends meet as a gig worker, she enters an apartment for a dog walk and finds the murdered body of the woman her husband left her for. The police believe Jen is the killer and arent interested in any other suspects, so its up to Jen, with the help of her college-aged daughter and her fellow gig worker and new friend Susan, to find the real killer.','https://bhalpin.gumroad.com/l/howifoundher?layout=discover&recommended_by=search',0,3),(418,'La fille sadique','https://public-files.gumroad.com/sgjtkot77g5hhpl4kozm070lqw0h',220,'A cruel mother finds she has raised a crueler daughter.\n\n19 pages, PDF.','https://astridannerose.gumroad.com/l/RFkFG?layout=discover&recommended_by=search',1,3),(419,'In the Greenhouse','https://public-files.gumroad.com/gm1aw2x2h17r0f4ewh375kifld50',220,'An isolated gardener tends to a nursery of vampiric plants.\n\n15 pages, PDF.\n\nCW: explicit self-harm.','https://astridannerose.gumroad.com/l/FUtTG?layout=discover&recommended_by=search',1,3),(420,'Spinach','https://public-files.gumroad.com/gqeqi3b7hsdeiygv52flrqvjmciw',227,'Spinach is a thought on fiction.\n\nThe grafting of familiarity unto strangeness, a transitional environment, which can take as many forms as we are able to give. It is a kind of timid and evocative fiction that youll find here, mislaid in the infinity of organisms of an elusive taxonomy.\n\nThese pages are a small intimate collection of original texts in different languages, standing alone as well as in dialogue with images and film photography, drawing little isles of fictionthe allusion to a story, known trails and unsuspected paths.\n\nWhere you can find our spinach leaves:\n\nLibreria del Convegno, Milan (copies nn. 50, 51, 52)\n\nSpazio BK, Milan (copies nn. 53, 54, 55)\n\nTCO, Palermo (copies nn. 40-49)\n\nDo you feel its weight?\n\n\n','https://spinach.gumroad.com/l/spinach_magazine?layout=discover&recommended_by=search',12,3),(421,'Beautiful Short Fiction and Poetry: The Madmen Among Us','https://public-files.gumroad.com/0y2t77cr4qz7ifkqstdgtpwq56io',228,'From a wanderer who finds a rope hanging from the clear desert sky to a man who is sure hell discover happiness in counting all the worlds beans to beautiful gardens that hold an invisible lover or a deserted boulevard where the smoky smell of revolution lingers, enjoy the unique voice of Victor Sandiego as he takes the reader over mountains and across sands to find an elusive spirit guide or kicked-off shoes on the hotel floor.\n\nPart prose, part poetry, these works alternately seethe and celebrate with their fantastic detail and a mythology that is allied with the divine and at the same time grounded in the footsteps of cultural outcasts who search for a deeper meaning of life among the stones and sidewalks of the city streets.','https://victordavid.gumroad.com/l/the-madmen-among-us?layout=discover&recommended_by=search',6,3),(422,'Chess Festive Bundle','https://public-files.gumroad.com/c46yscald3af87utq2s2ki0sur3z',229,' Celebrate the New Year with our exclusive Festive Season Special Offer!  Elevate your reading experience with a bundle that\'s not just a deal but a life changer!  Immerse yourself in the captivating world of chess and mysteries with our trio of transformative books at an irresistible price.\n\n Dive into \'Chess 101\', your ultimate guide to mastering the game from scratch.  Uncover Sherlock Holmes\' ingenious unraveling of \'A Scandal in Bohemia\', a chess-themed thriller that unveils the rise of a world champion and a witch\'s hidden secrets within a chessboard.  And discover the empowering journey of overcoming addiction through the power of chess.\n\nThis bundle brings wisdom, strategy, and thrilling tales  all aimed at enhancing your chess skills and offering inspiring narratives. Purchase this unique collection at HALF the total price this festive season! For inquiries or to seize this limited-time offer, reach out to us at admin@chessnotion.com. Wishing you joy, growth, and success in the New Year ahead!  #ChessNotion #FestiveSeasonSpecial #NewYearOffer','https://chessnotion.gumroad.com/l/Festivebundle?layout=discover&recommended_by=search',15,3),(423,'Merry Arlan: Finding The Heir (Signed)','https://public-files.gumroad.com/dcwcm6ui6yhcjeowim5ifij17248',230,'Merry Arlan: Finding The Heir is part two of the Guardian Cadet Series, an adult fantasy series with action adventure, heapings of magic, and a delightful heart-warming romance.\n\nMerry has never been a good liar. She is, however, adept at keeping secrets: she\'s been passing herself off as Human for years.\n\nBut that ruse and her position as a Guardian Cadet are called into question when the Elven Queen summons Merry to fulfil a role she ran away from years ago: Elven Lord.\n\nIf she wants out, she has to travel to the Elven Court  a vipers nest of lies and schemes that press against her unwilling bond with a lie-detecting, curse-breaking amulet  to find a replacement before the upcoming Mid-Spring Ball.\n\nTo deal with the Court and the pain of returning to a house that was once her prison, Merry has to turn to the last person she would expect to help her.\n\nAnd then assassins begin to strike at leaders on the Rubisle.\n\n_\n\nThis listing is for a physical signed paperback copy of Merry Arlan: Finding The Heir to be sent to the address of your choice along with some awesome Guardian Cadet Series merch (like character booksmarks and/or a postcard map, feel free to make requests but these are typically chosen at random)','https://willsoulsbymccreath.gumroad.com/l/MAFTH?layout=discover&recommended_by=search',12,3),(424,'Blackout','https://public-files.gumroad.com/lf95r1aktjy458bfkxa3mshwijcl',231,'by Steven Henry','https://clickworks.gumroad.com/l/erin17?layout=discover&recommended_by=search',6,3),(425,'American Garbage: The Meager Rise and Massive Fall of a No-Name Rock Band (Limited Edition Signed Paperback)','https://public-files.gumroad.com/qszbru3j2tvavdw7c4x1whyieqmp',232,'\n\n\nFeaturing a cover by Kelby Losack, is my first coming of age novel. Its 138 pages follow a young adult in a band of burnouts hes trying to hold together while navigating his own mental illness and tumultuous intimate relationships during the early years of the War on Terror. Buying it gets you a signed, limited edition paperback and a DRM-free PDF which should work on your favorite e-reader.\n\n-------\n\nEXCERPT:\n\nJonathan had already been tripping all day and had begun to plateau. Mike was starting to peak. I was dead sober and fucking miserable. Neither of my guitarists could figure out what to play. Jonathan would play a riff and Mike would just stand there with a slack-jawed expression. Jonathan would stop and mean-mug Mike. Mike would play his own riff and Jonathan would try to follow along, but with the peak of the trip coming on, Mike could hardly focus long enough to play in the same key, the same time signature, the same scale for more than a few seconds. Jim on drums was happy to be there, laughing at every false start. That was easy for him to do as hed be going off to college at the end of the summer. Jamming with us was just his way of killing time until then. Dean on bass just sat there, smoking cigarettes and watching. He had almost no training whatsoever but was pretty good at following instructions and could play anything we tabbed out for him later. It just didnt give him much to do when it was time to write new material. After the fourth or fifth false start, Mike set down his guitar and headed for the studio door. He had his hands up to his ears and the sweat glistened on the back of his bald head.\n\nHe gonna be okay? I asked Jonathan.\n\nFuck him. Prick.\n\nI was losing control.\n\n-------\n\nis a rock n roll tragedy full of sex, drugs, and shattered dreams','https://reallucasmangum.gumroad.com/l/PamZO?layout=discover&recommended_by=search',20,3),(426,'Firebrand PAPERBACK','https://public-files.gumroad.com/nfhfc02tnz47wz4qbbx363ggf2mr',233,'NO ONE is their authentic self at work\n\nCurrant Keppler has a fresh MBA and her first corporate job: participating in the LATTE Management Rotation Program at Alpine Chalet Coffee Company, the Midwest\'s second-largest coffee chain. She\'s fluent in jargon, excited for new challenges, and completely bought inuntil she realizes that there\'s something fishy with her first project.\n\nI\'m in the big leagues now, she tells herself. This is just how the game is played. But when a question of ethics turns into a question of murder, she learns that some people will do anything to succeed  and that NO ONE is their authentic self at work.\n\nCombining corporate culture, the start-up scene, cabin life, and punny coffee drinks, Firebrand takes a campy, loving look at impostor syndrome, authenticity, and the absurdities of the corporate world.\n\nA clever mystery replete with Millennials, MBAs, Marketing, and Macchiatos Its witty, fresh, and spot on.  Susan D. Steiner, Murder by Manuscript (the August Burns series)\n\n\"Funny, existential, and thought-provoking.\"  Mahmoud Rasmi, philosophy consultant\n\n\"As a Minnesotan and someone going into corporate life, I appreciated it.\"  Mya Sullivan, Minnesotan going into corporate life\n\nwww.alpinechalet.coffee','https://meganprestonmeyer.gumroad.com/l/Firebrand?layout=discover&recommended_by=search',13,3),(427,'Don\'t Look at the Moon: A Short Story (Story Only)','https://public-files.gumroad.com/8h8jkemzzi6r8chis3u07v0t3mzg',234,'\"Don\'t Look at the Moon\" is a short story about a young man who receives a nationwide text in the middle of the night simply saying, \"DO NOT LOOK AT THE MOON.\" Follow along as his whole world begins to unravel and he quickly learns that no one can be trusted.\n\n..........................................................\n\nLast school year, my Freshman were about a week ahead of the rest of the teachers so I threw in a quick one-week creative writing unit while we waited for the rest of the classes to catch up. I gave them an engaging prompt I found off the Internet and dished out some tips and pointers before having them go off and write their own story. The unit went so well that I decided to jump in and write my own since that\'s what I pretend to consider myself - a writer. They enjoyed my story so much that they were telling me to turn it into a movie or a full book, so instead, I just decided to publish it here. That\'s it. That\'s the origin of this short story. It\'s a piece of fiction geared towards younger adults. I\'m proud of how it came out. I hope you enjoy it as much as they did.','https://morrissweat.gumroad.com/l/TWykP?layout=discover&recommended_by=search',5,3),(428,'Errant Hope','https://public-files.gumroad.com/07ezsxxfv8ne6qfms2f8v4p08lzz',235,'It came from the heavens and brought disaster.\n\nCallums life was a hard one, toiling day after day as an unskilled labourer deep in the countryside. Never looking beyond the next winter, his lot was unremarkable and one with little hope of improvement. When an opportunity to earn easy coin falls into Callums lap, he readily accepts without thinking of the risk.\n\nWolves and brigands turn out to be the least of his problems, however, for a chance encounter with an old weathered sword puts him at the centre of mysterious events, earns him the attention of a suspicious knight and gains him some unlikely allies. Their journey for answers  one Callum has little choice but to go on  leads him to learn of the terrible responsibilities that come with wielding the sword and of an enemy whose goals will change his world forever.\n\nPulling inspiration from the science fiction and fantasy media of his youth and the lessons learned throughout his life about overcoming adversity, Errant Hope is Damien Jennison\'s first novel and the first steps in an epic adventure that will sweep you away.\n\nYou can buy a copy of the eBook here on Gumroad. If you\'re interested in a physical edition, you can buy one on Amazon instead.\n\nNote: you will be charged in USD, with VAT on top of the price if applicable for your country. The exact total will be shown at checkout.','https://kikoskia.gumroad.com/l/errant-hope?layout=discover&recommended_by=search',4,3),(429,'Off Planet - Aunare Chronicles, Book 1 (eBook)','https://public-files.gumroad.com/zljedl54i2e9i23twf0708ugjvoz',236,'Suspenseful sci-fi with complex world-building and a tough-as-nails heroine youll want to root for!  Elizabeth Briggs, New York Times Bestselling Author of Future Shock\n\nIn this bleak world, one spark of hope soon turns into an inferno. And just like a fireball, once this story is ignited, it just doesnt stop.  Maria V. Snyder, New York Times bestselling author of Navigating the Stars\n\nFrom USA Today Bestselling Author Aileen Erin comes the now complete Aunare Chronicles.\n\nIn an all-too-plausible future where corporate conglomerates have left the worlds governments in shambles, anyone with means has left the polluted Earth for the promise of a better life on a SpaceTech owned colony among the stars.\n\nMait Martinez is the daughter of an Earther Latina and a powerful Aunare man, an alien race that SpaceTech sees as a threat to their dominion. When tensions turned violent, Mait found herself trapped on Earth and forced into hiding.\n\nFor thirteen years, Mait has stayed hidden, but every minute she stays on Earth is one closer to getting caught.\n\nShes lived on the streets, gone hungry, and found a way to fight through it all. But one night, while waitressing in a greasy diner, a customer gets handsy with her. She reacts without thinking.\n\nCovered in blood, Mait runs, but its not long before SpaceTech finds her\n\nArrested and forced into dangerous work detail on a volcano planet, Mait waits for SpaceTech to make their move against the Aunare. She knows shell be used as a pawn soon. If she cant find a way to stop them, there will be an interstellar war big enough to end all life in the universe.\n\nBut how can one girlone prisonerprevent the total annihilation of humanity without getting herself killed in the process?','https://aileenerin.gumroad.com/l/yrmqn?layout=discover&recommended_by=search',2,3),(430,'Tex Randle: Brotherhood Of the Gun','https://public-files.gumroad.com/tysh79z8mr164a9v77jczvb35lvx',237,'William Raymond Tex Randle aspired to be the Wests deadliest gunfighter. Little did he know what fate had in store for him in the mining boom town of Yalta, California. Through an unfortunate incident he ends up at the mercy of the wife & daughter of one of his former victims. Confronted by their Christian love for even a man like him, Tex is confused & confounded at every turn. In the end, he has to take a stand  and try to stop the range war that drew him to Yalta in the first place!\n\nFormat : ePub & PDF','https://briancates.gumroad.com/l/feUYO?layout=discover&recommended_by=search',12,3),(431,'Melting Point','https://public-files.gumroad.com/xrikdwm1khi3pru4c1wf1zs4ioox',238,'When Maverick and August accept the job at the old winery in California, they assume itll be just like all the others, even if it is wildfire season  a mystery that isnt much of a mystery after you give Death a chance to explain itself.\n\nTheyre wrong.\n\nObviously.\n\nSince 1966, twenty-nine dead bodies have been found at the now-defunct winery; the rumors about how they got there range from patently, predictably absurd to downright chilling. It could be a serial killer, like the cops and the amateur detectives and the true crime enthusiasts all seem to think it is, or it could be something worse. Something darker. Something less natural, less humanless likely, as far as Maverick and August are concerned.\n\nTheyre wrong about that, too.\n\nMeanwhile, August is actually trying to start that fake ghost-hunting YouTube channel for reasons that dont quite make sense, and Charlies past connection to Nicholas Parrish is being yanked, kicking and flailing and screaming, right back into the spotlight, still just the slightest bit out of focus, and Maverick finallyfinallyhas a secret of his own.\n\nBlood, though.\n\nBlood is thicker than water, and it tends to leave a stain behind once its dry.\n\nHow deep should you have to dig to find the roots in your family tree? Six feet? Like a grave?\n\n\n\n\nsample | sequel to Gravediggers and Breathe Underwater','https://aanderson.gumroad.com/l/zCWvx?layout=discover&recommended_by=search',5,3),(432,'Fractal Futures','https://public-files.gumroad.com/eiycz607b8oomvck1qruz0svk163',239,'Stories from within a hundred years and beyond. Possibilities revealed ruthlessly. Hope springs eternal when the truth is acted upon.\n\nA collection of 19 original short stories of varying length mostly science fiction, all intertwined yet separate, exploring themes of personhood, technology, power and grace. Inspired by possibilities in AI, robotics, cosmology, 4D materials. Genres could be called Cyberpunk, Solarpunk, Lovepunk.\n\nWritten over the course of 2014 to 2022. The founder of Wired magazine and futures oriented person Kevin Kelley awarded the shortest story in this collection $100, so to get all these stories for $10 is an exponential deal!\n\nI really hope you enjoy these, some have been shared throughtout the years (thanks beta readers known and unknown) most have never been published before.\n\nThe future is always a story of the present with echoes of the past. We inherit the future from the stories told in the now. What future do we want? Explore this part of the fractal of futures...','https://jhana.gumroad.com/l/qvtza?layout=discover&recommended_by=search',8,3),(433,'The NaNoWriMo Kit','https://public-files.gumroad.com/rajdklyvpcjyqz4plsx7o1rfmu0o',240,'If you\'re a writer seeking to join the NaNoWriMo fun for the first time, how can you write a 50,000 word novel in a month without putting your life on hold? You grab a copy of this awesome kit!\n\n#theNaNoWriMokit is what every writer (with a life) seeking to participate in NaNoWriMo 2016 needs!\n\nThe NaNoWriMo Kit includes:\n\nA suggested daily word count goal\n\nHow to create an outline\n\nPages for character crafting\n\nTips for creating powerful sentences\n\nThe secret to writing a killer first chapter\n\nAdvice on how to edit your manuscript like a pro\n\nHow to break into Act Two, or your novels middle part\n\nWhere and when to submit your work to the official NaNoWriMo contest\n\nAnd much more!\n\nBut most importantly, the kit includes a tight, organized 30-day schedule that will help you reach your NaNoWriMo goal while keeping your day job and enjoying the nightlife.\n\nLearn more about it here:http://barelyharebooks.com/thenanowrimokit/\n\n(PLEASE SELECT \'DOWNLOAD\' AFTER PURCHASE NOT \'READ\', or \'OPEN IN APP\')\n\n\n\n','https://barelyharebooks.gumroad.com/l/jHqsF?layout=discover&recommended_by=search',10,3),(434,'Tentacle Head','https://public-files.gumroad.com/hquw1leffv5is7iobv5leoeao6cz',241,'Tentacle Head is back! Overflowing dumpster playtime it is!\n\nThis goopy horror (not-for-children) children\'s book has been out of print since the collapse of Bear Creek Press.\n\nNow this slime-slathered absurdist adventure has returned, newly reformatted by illustrator Sarah Allen Reed and ready for fresh readers to engulf like a greasy meatball.\n\nSee what happens when a nightmarish cast of weird little guys find what they think is a dead body  only to discover the horrible corpse is a living but ultra-depressed mutant: Tentacle Head.\n\nLincoln Michel, author of The Body Scout, says it\'s \"like The Little Prince reimagined by David Cronenberg.\"\n\nAmber Sparks, author of And I Do Not Forgive You, says it\'s \"like if the Garbage Pail Kids got their own moon and then made you feel sorry for them.\"\n\nB.R. Yeager, author of Negative Space, says it\'s \"a striking and wholly unique tale of apocalypse and survivors guilt.\"\n\nErica Satifka, author of How to Get to Apocalypse and Other Disasters, describes it as \"a twisted story of family and friendship in a fungus-strewn nightmare world.\"','https://rickclaypool.gumroad.com/l/wneqy?layout=discover&recommended_by=search',0,3),(435,'The Dream World Collective','https://public-files.gumroad.com/x7vp0ujiwvh6opirtaavtbonwvgq',231,'Written by Ben Y. Faroe','https://clickworks.gumroad.com/l/dwc1?layout=discover&recommended_by=search',8,3),(436,'Level Up or Die: A LitRPG Steampunk Adventure','https://public-files.gumroad.com/qv2wq30a4mhq8ghg6ps5s17j5cxq',242,'...blunt, fast-moving, entertaining...  Kirkus Reviews\nTo tear down the system . . .\n. . . Hes got to level up\n\n\n\n\nCondemned by the media circus of a Peoples Republic of California court, Donny is plugged into a deadly game as entertainment for the brutalized masses.\n\nTormented over failing his father, Donny realizes honor hangs in the balance.\n\nHis familys fate lies in his hands.\n\nDonny must battle through a cutthroat digital world to free thousands of political prisoners and bring down the corrupt system. But the futures most ruthless killers stand in his way.\n\nCan Donnys wits and unbreakable spirit get him out alive?\n\nFans of Ready Player One and Sword Art Online will love Level Up or Die, the new first-person steampunk LitRPG adventure from #1 bestselling authors Joshua Lisec and Adam Lane Smith. Read it today!\n\n','https://joshualisec.gumroad.com/l/levelupordie?layout=discover&recommended_by=search',10,3),(437,'SNOW: Complete Edition','https://public-files.gumroad.com/u4dji4aspl2af4kbioffkuhdl7xm',243,'SNOW is a graphic novel about a young woman named Dana finding her way among the creeping gentrification of Toronto\'s Queen Street West neighbourhood.\n\nIt won a Xeric Foundation grant for its production, was nominated for a Joe Shuster Award and was adapted into an independent feature film.\n\nThis high-quality PDF mirrors the second print edition with the complete story, behind-the-scenes bonus content, and even stills and info from the feature film adaptation.','https://benjaminrivers.gumroad.com/l/snow?layout=discover&recommended_by=search',0,3),(438,'Psychophysiological Responses to Bus Time Dilation Near Tooloobaika','https://public-files.gumroad.com/upqdrzqavdb8lqtxkrz7chb9s2d6',244,'\"A startling pressure cooker of a tale that will leave your mind thoroughly unsettledand make you question the veracity of 1-star reviews.\" \n Felix Futzbucker\n\n\n\n\nANOMALOUS HEATWAVE. WHAT NEXT?\n\nWaiting for a late bus is annoying enough. Add to the mix a sadistic sun, some morally questionable strangers, and dark twistsand an unremarkable bus stop transforms into an arena.\n\nWhen a group of travellers get stuck on an old, almost non-existent bus stop en route to the supposedly utopian village of Tooloobaika, ominous rural ennui erupts into surreal chaos. Petty tensions between the group boil over as characters reveal their inner demons under the baking midsummer heat.\n\nBeneath the tragicomic turmoil of political tension, generational conflict, radical conspiracies, and pagan cults, poignant themes emerge about human morality, apathy and empathy, despair and hope in an indifferent universe.\n\n~50 pages of exquisite dark comedy for 3+','https://vanyabagaev.gumroad.com/l/bus-time-dilation?layout=discover&recommended_by=search',1,3),(439,'Pillar and Support (PDF version)','https://public-files.gumroad.com/fidbcb5z4piq3sau4sdz5705yq1y',245,'Story of a rescue team and a female macro.\n\nEnglish//Color Illustrations/Furry/Rescue Team/Official MDA universe novel/Macro Furry\n\nStory / Illustration: Pederont\n\nTranslation: GasMaskFox\n\nPages: 52\n\nTexts: Approx 27,000\n\nIllustraions: 18\n\nStory line\n\n<The protagonist, Harber, who is active as a rescue team leader at MDA, is preparing to dispatch for rescue activities today, but is suddenly instructed to carry out a rescue operation in cooperation with a new female soldier of a giant race called \'Macro\'. Macros are the trouble MDA has fought so far, and are like enemies to Harber. Will Harber be able to complete the rescue operation with Kirina, the first enormous soldier hired by MDA?>\n\nPeople who helped me making this book\n\nIllustration advise - GasMaskFox, Notbad621, and SolutionWCS.\n\nTranslation help - GasMaskFox, WulfWaffle, and OddOldSoul.\n\nAnd thank you all who supports me through my Patreon!\n\n!!THIS DOES NOT CONTAIN PHYSICAL COPY OF THE BOOK!!\n\n Illegal acts such as illegal reproduction, distribution, or sale of content without the author\'s consent may be subject to legal action.','https://pederont.gumroad.com/l/CAGrD?layout=discover&recommended_by=search',6,3),(440,'Jackhammer','https://public-files.gumroad.com/5xbaysiupi5wi1dx2eeoje8xvy82',231,'by Steven Henry\n\nFREE BONUS STORY  This edition includes Screwdriver: A Vic Neshenko Story\n\n\n','https://clickworks.gumroad.com/l/erin22?layout=discover&recommended_by=search',6,3),(441,'White Lightning','https://public-files.gumroad.com/rgi79q75vu9dcwqj1xcvac06x72z',231,'by Steven Henry','https://clickworks.gumroad.com/l/erin20?layout=discover&recommended_by=search',6,3),(442,'Italian Stallion','https://public-files.gumroad.com/26ali90rp8lq4efl90pgnb9h928f',231,'by Steven Henry','https://clickworks.gumroad.com/l/erin19?layout=discover&recommended_by=