wn9flyj',236,'From USA Today Bestselling Author Aileen Erin\nTessa McCaide has had it up to here with supernaturals.\n\nLuciana may have failed to steal Tessas magic, but shes just getting started on her crusade for magical domination. If her demonic summoning isnt stopped, it could mean the end of everything.\n\nTessas pack, including her mate Dastien, are ready to fight, but the ragtag group of shifters and witches are no match for Lucianas power. A little help (and ancient Inca mojo) from Tessas bruja cousin, Claudia, may give the side of good a chance if she can make it home in time, but stopping the war is no longer an option.\n\nWhen witches and werewolves fight, no one wins. Only time will tell who will still be standing after the last spell is cast.\n\nThis book was amazing! I have loved this series since the first book and each book in the series as I got to know the characters a little more in each story just made me love them more.  Eve, Functioning Insanity\n\n\"Tessa is such a fantastic, strong heroine who displays so much bravery and loyalty its a complete pleasure to read. Aileen Erin is a wonderful author who has managed to capture every characters idiosyncrasies with ease with not a single boring moment in the series.  Lunaland','https://aileenerin.gumroad.com/l/edrtzn?layout=discover&recommended_by=search',5,3),(450,'The Convenient Wife','https://public-files.gumroad.com/l5gckjlc7iu59rlu73f8dx1ptgcf',250,'Short Summary\n\nAmid hidden family secrets, Charone Demme, a striking beauty with a painful truth, finds herself forced into a marriage of convenience with Axel Lodewyck, a towering figure grappling with a complicated past. As they navigate their unconventional union, their hearts intertwine, but can their love withstand the weight of their tangled family history? The Convenient Wife is a captivating story of loves triumph over adversity and the strength to break free from the shackles of the past.\n\n\n\n\nAbout the book:\n\nIn a world where secrets hide behind carefully crafted facades, Charone Demme is trapped in a life she never chose. Charone, with her striking 55 frame, chestnut-colored eyes adorned with tiny red flecks, and a bold presence, seems to have it all. But deep within, she carries the burden of a painful truth.\n\nOn the other side of the story stands Axel Lodewyck, a towering figure at 65, whose life has been marked by the cruel hand of fate. Axels mother had subjected him to life-altering hormonal treatments since childhood, and his quest to undo the damage has led him to Europe for two decades. When his mother passes away, her final decree throws him a lifelinehe can reunite with his beloved sister, Byrdie, but only if he ties the knot.\n\nByrdie, armed with newfound knowledge, devises a plan to free Charone from her overprotective guardianLisbeths fatherand reunite Axel with his sister. She proposes that Charone marry Axel, a marriage of convenience that will change their lives in ways they never expected.\n\nAs Charone and Axel navigate the complexities of their forced proximity and the bonds of matrimony, they find themselves drawn to each other. But Charones past trauma and Axels painful history threaten to tear them apart. In a world where family secrets hold the power to shape destinies, can Charone and Axel find a way to break free and build a love that transcends the confines of their unconventional marriage?\n\nThe Convenient Wife is a captivating tale of romance, resilience, and the enduring power of love in the face of adversity. Join Charone and Axel on their journey of self-discovery, acceptance, and a love that defies all odds.\n\nTropes/Genre\n\nForced Proximity\n\nMarriage of Convenience\n\nFamily Secrets\n\nIdentity and Self-Discovery\n\nOpposites Attract\n\nOverprotective Guardian\n\nLove Triumphs Over Adversity\n\nRedemption and Healing','https://sylviahubbard1.gumroad.com/l/convenientwife?layout=discover&recommended_by=search',1,3),(451,'Threads of Life: A Collection of Literary Fiction','https://public-files.gumroad.com/cmyqtj3vhluoflj4eevrjgspivcy',251,'A collection of three novels by Brian Prousky, now available in one volume!\n\nAuden Triller (Is A Killer): Simon and Auden Triller are twins with vastly different lives. Simon is accomplished, popular, and devoted to his unappreciative brother. Auden, on the other hand, wants nothing more than a simple life free from comparisons to his twin. As Auden\'s solitude leads to insanity, he loses his grip on reality, and his actions threaten to sever his bond with Simon just when he needs him most.\n\nGod Might Forgive Gershwin Burr: After his father\'s death, Gershwin Burr turns to stealing books as a remedy for his depression, but his thievery spirals out of control. Despite his wife\'s pleas to stop, he can\'t bring himself to quit until he\'s betrayed and arrested. Imprisoned and tormented by guilt, Gershwin seeks redemption and the identity of his betrayer in this beautifully written novel about trauma and redemption.\n\nThe Anna Geller Invention: A young poet named Harvey Painter is visited by a fan named Anna Geller, who gives him a single poem before disappearing. Thirty years later, an investigative reporter discovers that Anna has secretly given her poems to people around the world, turning her into a literary sensation. Harvey is swept up in the frenzy and becomes infamous when his poem is stolen. This novel is a tribute to poetry and a critique of celebrity culture.\n\n\n\n\nABOUT THE AUTHOR\n\nBrian Prousky spent most of his life as two distinct people. The first held a day job and raised a family and was public and sociable. The second ruminated over sentences and wrote books in secret and dreamed of a living a literary life. They shared little in common, mostly their obsessions  with Bob Dylan, Joni Mitchell, Mozart, Saul Bellow, Roberto Bolano, tennis and hockey.\n\nSomehow, summoning up a kind of courage or resolve hed assumed was absent from his DNA, the first Brian Prousky left his day job, revealed his secret and dedicated himself full-time to writing. And the two Brian Prouskys became one. Now the author of four novels, Auden Triller (Is A Killer), God Might Forgive Gershwin Burr, The Anna Geller Invention and Healing Brian Esseintes, as well as a collection of short stories, Jupiter the Stupider, and two books of poetry, Body of Winter and Meeting Poems, he lives and works in Toronto, where most of his characters, who struggle with secret and often conflicted lives of their own, and who never quite fit in, do as well.','https://nextchapterbooks.gumroad.com/l/threads-of-life?layout=discover&recommended_by=search',8,3),(452,'We Said Goodbye To Gravity (32 pages)','https://public-files.gumroad.com/h4thpbhtceer62ju4i2jwfbhjjtn',252,'A collection of 6 short stories by yours truly.','https://chrisbaldie.gumroad.com/l/chKfW?layout=discover&recommended_by=search',4,3),(453,'Boulevard, Vol. 32, 1 (Fall 2016)','https://public-files.gumroad.com/h1eaexhqahu5h46zes4lideg0w4d',253,'Featuring new work by Zeina Hashem Beck, Diana M. Chien, Jerry Harp, Clarence Major, Shara McCallum, Joyce Carol Oates, Kevin Prufer, Mark Rudman, Anis Shivani, and many more writers, both award-winning and emerging. Also: surrealistic and enchanting cover art by Rafal Olbinski, Josuak Idaszak\'s winning 2015 Fiction Contest story, and a symposium on technology within writing.','https://boulevardlitmag.gumroad.com/l/vjFKd?layout=discover&recommended_by=search',7,3),(454,'The Orphan and the King Series, Volume 3 : The Final Conquest','https://public-files.gumroad.com/uqu2p56krrbyyzqw00zgstvh9th1',254,'Written by Best-Selling Author Wendy Anne Hunt\n\nArt by Alphonso A. Cornelius\n\nAvailable in paperback and kindle on Amazon.\nhttps://www.amazon.com/Orphan-King-Vol-Final-Conquest/dp/0981456138/ref=sr_1_1?crid=2EY7V7B7F45S7&keywords=the+orphan+and+the+king%3A+The+Final+Conquest&qid=1693963873&s=books&sprefix=the+orphan+and+the+king+the+final+conquest%2Cstripbooks%2C96&sr=1-1\n\nIncludes:\n\n-Book in pdf format.\n\n-Over 30,000 words.\n\n-Original artwork\n\nCaptain Luis Changelle is a highly regarded leader in Darius\' army. But all that is about to change forever. Luis suddenly finds himself charged with treason and running for his very life. Luis is reunited with his sister, and the two find themselves on an adventure that neither of them could have ever imagined. With several adrenaline-pumping twists and turns, and many good-natures laughs along the way, the journey of this heart-warming and dynamic brother-sister duo ends them up in the middle of an epic war to end all wars.\n\nLet your imagination soar to a land filled with kings and wizards, dragons and damsels in distress, dungeons, dwarfs and enchanted forests. Fantasy and reality meet in a suspenseful story of love, honor and courage against all odds...of faith and hope...magic and mystery...treachery, treason and terror...compassion and redemption.\n\nMay this touching story warm the hearts and stir the souls of all who open its pages!','https://wendyannehunt.gumroad.com/l/zzfit?layout=discover&recommended_by=search',4,3),(455,'Te Kerer: Part 3 - Stretching Her Wings','https://public-files.gumroad.com/jedk422u7jvqh4ptd3sxzka0ikph',255,'STRETCHING HER WINGS - PART 3 OF TE KERER IS OUT...!\n\nThis is part THREE in the Te Kerer series by SG SMITH which is soon to become New Zealands most favourite speculative fiction series.\n\nContact me for movie rights please, Taika Waititi...!\n\nKate Taylor is growing up\n\nKate Taylor, the odd Pkeh child who was orphaned as a baby and raised in a Maori village in beautiful Aotearoa New Zealand, is now approaching 16 and growing up fast.\n\nShe\'s learning about French cooking and French wine too and is starting to play \"he loves me, he loves me not\" with the young men in her world.\n\nNot everything is perfect in paradise in Part 3 of Te Kerer\n\nKate is expanding her borders and starting to stretch her wings with trips outside the village and region but not everything is perfect in paradise.\n\nThere are secrets whispered in the dark and Kate\'s world is about to be turned upside down with the loss of someone very special.\n\nIf you\'ve been following Kate\'s journey in Parts 1 and 2 you\'ll know that Kate is a survivor. She\'s about to be heartbroken but she\'s never really been alone and she\'s stronger than she knows.\n\nIn her own way, Kate must come to terms with death, sex and violence\n\nJoin Ppara, Nan, Whiti, Te Wai and the rest of her whnau as they help Kate navigate issues of life and death, sex and violence.\n\nAnd intertribal politics.\n\nAnd secrets.\n\nThere are more hints to some of the mysteries that surround Kate and perhaps even some answers as we reach the exciting conclusion of the the finals of the Kapa Haka\n\nWelcome back to Katherine Taylors world\n\nAfter a devastating accident, Katherine Taylor, who was born to Pkeh parents, is adopted as a young child by the most powerful Mori family in the region in Part 1.\n\nDiscover more about Kate and her world in Part 2 as she ventures out and faces new challengesin her early teenage years\n\nNow in Part 3 she\'s coming to terms with life and death and finding out who she really is.\n\nTe Kerer, Part 3 - Stretching Her Wings is now available...!\nYou can buy the full version of Te Kerer - Part 3: Stretching Her Wings here on Gumroad.\n\nJust click I want this! and you can join Kate as she continues on her journey.\n\nWho is SG Smith?\n\nKia ora ttou\n\nKo Tauhara te maunga\n\nKo Waikato te awa\n\nKo Taup-nui-a-tia te moana\n\nKo Smith tku whnau\n\nKo Susan toku ingoa\n\nI\'m a writer of speculative fiction living on the edge of a super-volcano. If you want to know more about my writing or get in touch, you can:\n\nFollow me on Twitter - @sgsmith_\n\nCheck out my blog - tekereruthebook.com\n\nHere\'s what people are saying about Te Kerer - Part 2\n\nCan\'t wait for Part 3...!\n\n\"Im so excited to see you complete part three! I cant wait to buy it, and read it yay!\" - LR\n\nYou won\'t be able to put it down\n\n\"Well I stayed up nearly all night reading the second instalment! I couldnt put it down. Very sad to get to the end!\" - LR\n\n\"Beautifully written\" - MF\n\nLearn a lot more about New Zealand society\n\n\"I wasnotably enthusiasticabout S.G. Smiths first novel, part one of what promises to be a long and fascinating journey. In Book 2, we follow Kate during her transition from girl to the edge of womanhood, learn a lot more about New Zealand society and Mori culture and life, and get deeply into the fascinating world that the author has created from the elements of the real New Zealand and her imagination\n\nThe world ofTe Kereris, as the author refers to it, speculative fiction, with the Mori group/clan and its village and the nearby city and lands specificallynotclosely based on any real life example. It seems to me to be a sort of idealized depiction, what could, and may, be in the future. I began to realize more as I read this second book that Kate is an archetype, a Stranger in a Strange Land who becomes embedded in a different culture and (perhaps?) brings new perspectives and a new integration of different worlds.\n\nBut this book is a sort of serial, bearing a resemblance to the great old movie houses where the audience come back every Saturday and watched another episode, with new revelations and resolution of some issues, followed by new complications.\n\nThe big complication is Kates budding womanhood\n\nIn this installment the big complication is Kates budding womanhood, but with surprising and important differences from the usual and well-worn tropes weve seen in a hundred Hollywood movies. Kate isexceptional, in some ways brilliant, wise beyond her years, but also very introverted and some might even say mildly autistic.\n\nIn fact, Im as fascinated by Kate as by any character Ive read in fiction for a long time. We learn a lot about her, but somehow most of it seems external, the keen observations of others. Thereisinternal dialogue and descriptions of Kates thinking, and yet even after two books Kate is still something of a mystery to me, and I like that. She seems destined for something bigbut what?\n\nThe author has skillfully built a a truly interesting world, and a woman, that I want to find out much more about. And thats my definition of a good book.\n\nTe Kerer Book 2  Shaking the Neston GumRoad includes Book 1 as a package deal, so you dont need to worry if you havent read the first volume. Highly recommended.\" - Neovictorian\n\nHere\'s what people are saying about Te Kerer - Part 1\nA gorgeous little story\n\n\"I sat in the sun yesterday and read your book. It is lovely and not something I usually read which is why it is nice to be given the opportunity.\n\nIt really is a gorgeous little story (and I know there is more to come). The descriptive details of the village and inhabitants is great and one can really imagine life there. I quite liked the gang related connections and wonder what is going on there. I expect there will be more to come\n\nAnyway it is a lovely story, well written and descriptive.\" - Adrienne N.\n\nA delightful little book\n\n\"The best thing about being on Twitter has been discovering new authors. I also love the humor, but good books > funny .gifs.\n\nIll do another post with the (long) list of fine writers and their books Ive discovered there, but today we focus on one delightful little book (or Part I of a delightful long book) Te Kerer by Susan G. Smith.\"\n\nKate\'s something more than what she seems\n\nTe Kerer is the Mori name for the native New Zealand wood pigeon, a beautiful and tasty bird. When three-year-old Katherine Taylor, a Pkeh (white person) is orphaned by a massive landslide, she is adopted by the regional Mori chiefand by the village and its people. Given the nickname Te Kerer, little Kate is different, quiet, mysterious, apparently the proverbial old soul. But the book subtly hints shes something more than this, something bigger\n\nWithout trying hard in any way, were educated about the New Zealand Mori culture and society, something I had only a slight knowledge of before reading Te Kerer. The author obviously loves her country and its people and the book opened up a new piece of the world for me, as I believe it will for most readers.\n\nThe only thing I didnt like about this book was that it ended\n\nHer style is clear, limpid is the old-fashioned word, mostly short declarative sentences, but skillfully layered one upon another, sips not gulps, and very satisfying, in the long run.\n\nThe story is developed through a series of scenes or vignettes, glimpses of events and pieces of conversations, a technique I also use and can appreciate. Each chapter is a facet of a gem, and gradually we begin to see something taking shape, a mission or a destiny, andend of Book 1.\n\nLike the wonderful old movie serials, the present volume leaves the reader wanting more. This isnt so common these days, but Im all right with it. I understand the next book will be available soon, which I hope is true.\n\nBecause the only thing I didnt like about this book was that it ended.\" - Neovictorian','https://sgsmith.gumroad.com/l/tekereru3?layout=discover&recommended_by=search',5,3),(456,'The Orphan and the King Series, Volume 2 : Love\'s Great Ransom','https://public-files.gumroad.com/e866mdnk2w7a7t5s87ao8qiaxm5f',254,'Written by Best-Selling Author Wendy Anne Hunt\n\nArt by Alphonso A. Cornelius\n\nAvailable in paperback and kindle on Amazon.\nhttps://www.amazon.com/Orphan-King-Loves-Great-Ransom/dp/098145612X/ref=sr_1_1?crid=257IWP4OPS8KM&keywords=the+orphan+and+the+king%3A+Love%27s+Great+Ransom&qid=1693962782&s=books&sprefix=the+orphan+and+the+king+love%27s+great+ransom%2Cstripbooks%2C90&sr=1-1\n\n\n\n\nIncludes:\n\n-Book in pdf format.\n\n-Over 30,000 words.\n\n-Original artwork\n\nUnexpected tragedy threatens to destroy young Wesley on his path to the throne to be King Reagale\'s successor. Evil infiltrates his life once again, as his past casts a dark shadow of terror over this wonderful new life he has been given, tearing to shreds any hopes for the future and dashing his dreams of a \'happily ever after\'. A dim flicker of light emerges from the ashes that remain of his broken life that, with resolved determination and strength of will, might yet see his dreams fulfilled.\n\nLet your imagination soar to a land filled with kings and wizards, dragons and damsels in distress, dungeons, dwarfs and enchanted forests. Fantasy and reality meet in a suspenseful story of love, honor and courage against all odds...of faith and hope...magic and mystery...treachery, treason and terror...compassion and redemption.\n\nMay this touching story warm the hearts and stir the souls of all who open its pages!\n\n','https://wendyannehunt.gumroad.com/l/byvfxt?layout=discover&recommended_by=search',3,3),(457,'The Story of Alex Taylor','https://public-files.gumroad.com/80qdp5fusz9kx9q7sv14oydfm8ov',256,'In \"The Story of Alex Taylor,\" immerse yourself in the remarkable odyssey of Alex, whose life takes an unexpected turn after an unforeseen tragedy.. This captivating narrative explores the depths of the human spirit as Alex faces adversity with unwavering determination and resilience. Discover the unbreakable bonds that form with family and friends, the profound moments of self-discovery, and the inspiring journey from survivor to advocate.\n\nAs you follow Alex\'s path of healing and self-discovery, you\'ll witness the emergence of newfound passions and an unshakable belief in the power of second chances. \"The Story of Alex Taylor\" is a testament to the strength found in vulnerability, the joy of embracing change, and the enduring hope that even in the face of life-altering challenges, a brighter future awaits those who persevere.\n\nThis book is an inspiring reminder that every setback is an opportunity for growth and that with resilience, the human spirit can be reborn anew.','https://tonyrosenberg.gumroad.com/l/the-story-of-alex-taylor?layout=discover&recommended_by=search',3,3),(458,'Beyond The Crack In The Sidewalk','https://public-files.gumroad.com/e6nun8ga3fvgm8eval008x7dxo7t',251,'The short stories in \'Beyond The Crack In The Sidewalk\' explore aspects of living, loving and dying: the main elements that define our human existence. Included is also a lighter story: a mystery written in the vein of \"The Twilight Zone\".\n\nThe characters in these stories range in age from seventy-year-old Gloria, who is about to find love again, to five-year-old Bobby, who has no concept of why his daddy is no longer there. Then there\'s sixteen-year-old Hannah, a runaway who finds love only to lose it.\n\nOn a philosophical level, these stories reflect the world in which we live, bringing to light social issues such as homelessness, the human cost of war, sexual abuse, and when do we go too far in medical treatment.\n\n\n\n\nABOUT THE AUTHOR\n\nMaryann Miller, an award-winning author, has been in love with story-telling since she was a child and used to scare her sister with stories of the monsters in the cellar. Those tales were never written down. They were always whispered in the dark, and when Maryann started writing stories, they were different types entirely.\n\nAs a young child, she didn\'t consider that she would grow up to be a writer. She fancied herself quite the singer and thought she would someday sing in front of crowds of thousands. Alas, that proved to be more dream than reality.\n\nA diverse writer of columns, feature stores, short fiction, novels, screenplays and stage plays, Maryann has won numerous awards including being a semi-finalist at the Sundance Institute for her screenplay, A Question Of Honor. She has also received the Page Edwards Short Story Award and the 2015 Best Mystery award for Doubletake.\n\nMiller lives in a small town in NE Texas with one dog, and four cats. The cats rule! She has been writing all her life and plans to die at her computer.','https://nextchapterbooks.gumroad.com/l/beyond-the-crack-in-the-sidewalk?layout=discover&recommended_by=search',3,3),(459,'Death\'s Dream Kingdom','https://public-files.gumroad.com/6be0pe44qezuozyadtezuobdo7va',231,'Written by Gabriel Blanchard','https://clickworks.gumroad.com/l/redglasstrilogy1?layout=discover&recommended_by=search',3,3),(460,'The Orphan and the King Series, Volume 1 : The Freedom Mission','https://public-files.gumroad.com/wz5q6mjsdmiaqqgdc2s0ckja8q4g',254,'Written by Best-Selling Author Wendy Anne Hunt\n\nArt by Alphonso A. Cornelius\n\nAvailable in paperback and kindle on Amazon.\nhttps://www.amazon.com/Orphan-King-Freedom-Mission/dp/0981456103/ref=sr_1_1?crid=12IPCVL72XBPK&keywords=the+orphan+and+the+king+the+freedom+mission&qid=1693961589&sprefix=the+orphan+and+the+king+the+freedom+mission%2Caps%2C96&sr=8-1\n\nIncludes:\n\n-Book in pdf format.\n\n-Over 29,900 words.\n\n-Original artwork\n\n\n\n\nDevastated by the tragic loss of his parents, young Wesley finds himself an orphan in a very unforgiving and cruel world. Forced to the streets to beg for survival, one unsuspecting day he meets a man who will change his life forever. Given the opportunity to become heir to the throne, he must battle the plans of the evil sorcerer intent on destroying his life and the entire kingdom.\n\nLet your imagination soar to a land filled with kings and wizards, dragons and damsels in distress, dungeons, dwarfs and enchanted forests. Fantasy and reality meet in a suspenseful story of love, honor and courage against all odds...of faith and hope...magic and mystery...treachery, treason and terror...compassion and redemption.\n\nMay this touching story warm the hearts and stir the souls of all who open its pages!','https://wendyannehunt.gumroad.com/l/kqnkm?layout=discover&recommended_by=search',3,3),(461,'Los dos soles de Toledo - Alonso (de) Alcala y Herrera','https://public-files.gumroad.com/kyu1m9w8rg5x3vzjnk639w2q4k2u',257,'Sinopsis de LOS DOS SOLES DE TOLEDO\n\nEn Los Dos Soles de Toledo, Alonso de Alcal y Herrera nos transporta al corazn de la historia de Espaa. A travs de relatos apasionantes, descubriremos a los personajes que forjaron el destino del pas. Desde los grandes conquistadores hasta las tradiciones ms arraigadas, esta novela histrica nos sumerge en la rica cultura de Espaa. Llena de intriga y emocin, esta obra es un testimonio de la grandeza y la pasin que definen a la nacin.','https://bookcollections.gumroad.com/l/dvynw?layout=discover&recommended_by=search',6,3),(462,'El conde de montecristo - Alexandre Dumas','https://public-files.gumroad.com/61bke59lwhyw5fm68940ko4oq3gv',257,'Novela de aventuras por excelencia, El conde de Montecristo narra la peripecia del joven Edmond Dants, cuyo prometedor destino se trunca al verse acusado inesperadamente de agente bonapartista y ser encerrado en el adusto castillo de If. All, una extraordinaria serie de acontecimientos lo conduce a poder llevar a cabo una fuga inslita y desesperada en posesin del secreto de un fabuloso tesoro. Aos despus, de regreso en Marsella, viene a conocer que su arbitrario encierro fue debido a una conspiracin. Ser entonces cuando, con ayuda de sus inmensos recursos y de su ingenio, Dants, adoptando la personalidad de conde de Montecristo, pondr en marcha una implacable venganza para acabar con aquellos que propiciaron su ruina.\n\n\n\n\n\n\n','https://bookcollections.gumroad.com/l/pwxxt?layout=discover&recommended_by=search',6,3),(463,'The Prophet: A Novel','https://public-files.gumroad.com/87x49i3ql58b2asi103wej3nu53s',258,'\"Marked by gritty action, a weaving of complex narratives and- most notably- brave characters facing hard choices, Harry Marks\'s new thriller, The Prophet, delivers it all.\" - Steph Post, author of MIRACULUM and HOLDING SMOKE\n\nContent Warning: Sexual Abuse, Violence\n\nTwelve year-old Callie Rich wouldnt know what a normal childhood looks like. She and her family have been a part of the Lambs of Zion church their entire lives, existing in a well-guarded pocket of the American southwest where modernity and independence are shunned. When their leader, the Prophet, excommunicates her fatherone of his closest advisorsand takes Callie to be his next bride, it has to be a mistake.\n\nOne town over, private detective Max Barker is well aware of the polygamist cult on the Arizona-Utah border, but he keeps his distance like everyone else until Callies father shows up on his doorstep begging for help. His family is in danger and he has the proof that could bring the whole organizationand its leadercrashing to the ground. Max, hoping to make good on a promise hed kept to a former Lamb, decides to help.\n\nUnaware of her fathers plan, Callie joins up with a group of other wives looking to escape, but someone inside the church knows what theyre up to. While Max and Callies father work to infiltrate the church for evidence, Callie and the other women of the LoZ must hurry and leave before the Prophet takes drastic action to keep his church, his family, and his legacy intact.','https://hcmarks.gumroad.com/l/qFHMLQ?layout=discover&recommended_by=search',3,3),(464,'O Equilbrio dos Espelhos: Uma Jornada Atravs das Dimenses','https://public-files.gumroad.com/dofzu4o6gd9rs5wpjtehcbklqaei',259,'\"O Equilbrio dos Espelhos: Uma Jornada Atravs das Dimenses\"  uma aventura emocionante que segue a jornada de Emily e seu av, o Professor Montgomery, enquanto exploram um mundo mgico de espelhos vivos. Quando um espelho quebrado desencadeia uma invaso de criaturas de outras dimenses em seu mundo, Emily e seu av embarcam em uma misso para restaurar o equilbrio entre os mundos. Confrontando desafios, criaturas mgicas e revelaes surpreendentes, eles aprendem que a restaurao do equilbrio  uma tarefa constante e que sua jornada  parte de um ciclo maior. Um final surpreendente e reflexivo deixa os leitores com uma sensao de satisfao e uma apreciao pela interconectividade entre as dimenses.','https://designoalonso.gumroad.com/l/ggmpt?layout=discover&recommended_by=search',10,3),(465,'O Ferro Velho','https://public-files.gumroad.com/vls1jppuf4xhyvoiqrirnc1zjq24',259,'No corao de um ferro velho esquecido pelo tempo, os carros abandonados ganham vida  noite e compartilham suas histrias. Big Pete, um veterano da Segunda Guerra Mundial, Rosie, um Cadillac rosa de Hollywood, e Sunshine, um fusquinha amarelo de aventuras, so alguns dos carros que contam suas histrias emocionantes. Mas a histria mais comovente  de Rusty, um carro de famlia simples que encontra significado nas lembranas compartilhadas com amor. Sua histria inspira todos a valorizar os momentos comuns e as conexes humanas. Junte-se a esses carros cativantes e descubra a riqueza das histrias esquecidas no ferro velho das memrias.','https://designoalonso.gumroad.com/l/holwd?layout=discover&recommended_by=search',10,3),(466,'O Dilema de Isabel','https://public-files.gumroad.com/4wcd3p8teqxud9r2s0dfe3pdqu19',259,'Este livro narra a inspiradora jornada de Isabel, uma mulher de princpios slidos que ingressou na poltica com a misso de fazer a diferena em sua comunidade. Ela enfrentou dilemas ticos, resistindo a comprometer seus valores em meio a um cenrio poltico cheio de escndalos e corrupo.','https://designoalonso.gumroad.com/l/qsjmv?layout=discover&recommended_by=search',10,3),(467,'DESIGNO e KHEME','https://public-files.gumroad.com/ge7xic1g9w6dhbijup7f41ljwu4i',259,'Os heris Designo e Kheme, equipados com inteligncia e astcia, unem foras aps descobrirem que Destrutor ameaa a cidade com seus poderes incontrolveis. Juntos, eles enfrentam Destrutor em um pico confronto, onde a astcia e a determinao se enfrentam contra a arrogncia e o desejo de poder.','https://designoalonso.gumroad.com/l/gvmsq?layout=discover&recommended_by=search',10,3),(468,'Paladin of the Tomb','https://public-files.gumroad.com/7ht6rb3s5ib2p2499m962lr7p7wb',256,'Gallus Auxentius, Paladin of the Tomb, is the last hope of humanity. The immortals have awakened, and they are bent on destroying the world. Only Gallus, with his legendary sword Heart of the Storm, can stand against them.\n\nBut Gallus is not alone. He is joined by a group of unlikely companions: a sorceress, a dwarf, a snarky rogue, an ancient warrior, and a monk. Together, they will embark on a perilous journey to defeat the immortals and restore balance to the world.\n\nAlong the way, they will face dangerous creatures, treacherous challenges, and their own inner demons. But they must persevere, for the fate of the world hangs in the balance.\n\nPaladin of the Tomb is a thrilling adventure story full of action, humor, and heart. It is a story about friendship, courage, and the power of destiny.\n\nRead it now and join Gallus and his companions on their epic quest!','https://tonyrosenberg.gumroad.com/l/gallus-auxentius-book-1?layout=discover&recommended_by=search',4,3),(469,'Little Lord Fauntleroy Audiobook','https://public-files.gumroad.com/fvelw24i3x0zhr4f99y3w3r2ng8m',249,'You can download the audiobook for FREE. Just write \'0\' under Name a fair price.\n\nHowever, you can still pay us a few dollars if you wish because we giveaway 10% of all profit to feed hungry children via akshayapatra.org.\n\n\n','https://readunlimited.gumroad.com/l/Little-Lord-audiobook?layout=discover&recommended_by=search',0,3),(470,'Luna Station Quarterly 048','https://public-files.gumroad.com/f5l4fr1hny3duh0u3n557bapuaqe',260,'Just browsing the titles and summaries of these stories as I was preparing to write this editorial, I was struck by how many different ways these women have found to write stories about our sky neighbors. Maybe they were raised in more bird friendly places than I was. Or maybe they just looked up more than I did when they were small. - From the editorial\n\nThis issue features stories by:\nJennifer Lyn Parsons  Elizabeth Hinckley  Laney Gaughan  Rebecca Burton  Alyssa Villaire  Meghan Louise Wagner  Alex Grehy  Leanne Howard  Emma Schmid  Andrea Goyan  Heather Del Piano  Kristina T. Saccone  Katrina Carruth  Jenna Hanan Moore  Nikki Blakely  Jen Mierisch\n\nOur gorgeous cover was created by:\nJana Heidersdorf\n\nThank you for your support and\nplease spread the word about the new issue!','https://lunastationpress.gumroad.com/l/lsq-048?layout=discover&recommended_by=search',3,3),(471,'Luna Station Quarterly 053','https://public-files.gumroad.com/uilo40jkn24q4h71yflgw6o911an',260,'The promised rebirth of the sun is just over the next hill, and so, like incorruptible nature itself, LSQ returns for another season of scintillating stories by the best up and coming female identified talent in this or any other Spring kissed star system.\n\nAfter over thirteen years and fifty plus issues, you know what we do by now. Fairy tales and future times bump up against myth and melancholy. Young women and old crones and shapeshifters and the angel of death all walk among these pages.\n\nWe hope youll walk among them as well.\n\nThis issue features stories by:\nA. M. Young  Libby Heily  E.M. Gaucher  Chloe Smith  Holly Schofield  Anna Ziegelhof  Rebecca Harrison  B. B. Garin  V.J. Hamilton  Chelsea Catherine  Ruth Joffre  P. L. Watts  Anna Martino  Ann Wuehler  Shannon Roberts  Sam Lesek\n\nOur gorgeous cover was created by:\nOlivia Hintz\n\nOf course you canread the stories for free online,but why not buy a copy of our fancypaperback edition?\nCheck out the links below to learn how.\n\nThank you for your support and\nplease spread the word about the new issue!','https://lunastationpress.gumroad.com/l/lsq-053?layout=discover&recommended_by=search',3,3),(472,'Mithila Review 11: The Journal of International Science Fiction & Fantasy','https://public-files.gumroad.com/kuwdg0ezcedbc0qbm3sdpv72phn7',261,'TABLE OF CONTENTS\n\nFICTION\n\nOn the Seventh Day by Elaine Vilar Madruga, translated by Toshiya Kamei\n\nThe Great Wall of America by David A. Hewitt\n\nThe Domovoi by Avra Margariti\n\nThe Devil Buys Us Cheap and the Devil Buys in Bulk by M. Bennardo\n\nDomesticated by Timothy Bastek\n\nNo Folly of the Beasts by Wren Wallis\n\nPOETRY\n\nHow To Lie About SN 2213-1745 by Mary Soon Lee\n\nJoining the Navy & Threads of Honor by Phoebe Low\n\nSteel Dust & Soothsayer by Qurat Dar\n\ntetrahedral edifices of a sticky rice realm by D.A. Xiaolin Spires\n\nChurning of the Ocean by Uma Menon\n\nThe Moth Spectacular by Adele Gardner','https://mithilareview.gumroad.com/l/mr11?layout=discover&recommended_by=search',3,3),(473,'Stealing Innocence III: His African Sweetheart','https://public-files.gumroad.com/k46bzxnpco1uxuux7q09g7ht5k9p',250,'Enola was experiencing her sister\'s fantasy with her soon to be brother in law... yet, The pain from Aeden\'s past drive him to his goal and at every turn, he makes sure she will never be happy and never have anything.\n\nShe was experiencing her sister\'s fantasy with her soon to be brother in law... to be His African Sweetheart\n\nEnola prided herself in tradition and culture, but when her twin tricked her into trading places, she had to make the best out of the situation.\n\nYet, she did not know this was the beginning of a situation she had no control over and no matter how much she tried, she could never be able to win because Aeden Faust would never lose.\n\nAeden was a man bent on revenge and unfortunately Enola was in his path. Never a man who let anything get in his way, he is determined to destroy this woman and prove there is no such thing as a good woman.\n\nThe pain from his past drive him to his goal and at every turn, he makes sure Enola will never be happy and never have anything.\n\nYet, he comes to find Lust feels like love until it\'s time to make a sacrifice. Would he be able to let go his lust for revenge to achieve the perfect life with His African Sweetheart?\n\nStealing Innocence is the third installment in the standalone stealing innocence premise. Readers can start at this book and pick up the other stealing innocence series later, while they await for the last book in this series: Stealing Innocence: Lethal Heart.','https://sylviahubbard1.gumroad.com/l/stealinginnocenceiii?layout=discover&recommended_by=search',3,3),(474,'MORTALIA - Book of Short Stories','https://public-files.gumroad.com/wdlhcin2mgkcb2hecgmt6oe67fqy',262,'28 Short Stories, some previously seen and some not','https://theyravenboutme.gumroad.com/l/mortalia?layout=discover&recommended_by=search',5,3),(475,'The Katelyn Diaries: Mamihlapinatapai','https://public-files.gumroad.com/qteezmfxua1grp3tuzd1vs16sdc0',263,'The chicks hate her\nThe blokes love her\nAnd she\'s a parents worst nightmare.\n\nKatelyn is back pulling that samebipolar shitthat she was in the first book, that had that poor bloke Bentley reaching for the painkillers to treat the perpetual migraine that she brings to his life.\n\nWhile Katelyn is convincing herself that Bentley might be hooking up with other girls, he\'s busy getting his arse kicked because he feels a constant moral obligation to protect the girl who can\'t decide.\n\nTo add insult to injury, Katelyn displays a masterclass in manipulative game playing when she drags other guys in to create love triangles; when the situation starts to fall apart she insists that it\'s all Bentley\'s fault, because it couldn\'t possibly be the consequences of her own actions.\n\nA modern day love story, that all the \'cool kids\' are referring to as the white trash Romeo & Juliet.','https://thekatelyndairies.gumroad.com/l/uFBRi?layout=discover&recommended_by=search',5,3),(476,'A Mysterious Stranger Come To Town','https://public-files.gumroad.com/vqfi0eccl7oxacpgk5t22xf7xbs5',264,'A lot of stress and heartache finally resulted in a fully finished book.\n\nA over 150 page story about a Deputy working in a small town trying to find the cause of his beloved cousin\'s death. He meets a very odd man offering to help solve the case and out of desperation, he accepts the offer even though the strange man could possibly not be human.\n\nThe document was edited by BirbFairy from Deviantart under a super tight deadline. I can\'t thank them enough for their work. Please also go and thank them for all the effort they put into helping me with this.','https://kaioshindbz.gumroad.com/l/SfOoW?layout=discover&recommended_by=search',2,3),(477,'Heaviness Leaves The Body','https://public-files.gumroad.com/7yeoz5x9t63264czzjbddu0r9a45',265,'Heaviness Leaves The body is the self-published debut of Portland author Michael Kurt. Collecting three early short stories, this chapbook blends weird fiction, existentialism, and contemporary literature styles to examine our relationships to a house and a body.\n\n\"Heaviness Comes With The Night\" is the first and longest of the stories. When Casper leaves for college, the nameless narrator spirals through time and memory, trying to find a way back to young love.\n\nIn \"LEAVES,\" an experimental A.I. turns on its creators. Raking leaves, forever raking leaves.\n\n\"Homebodies\" is a house full of people refusing to expand. What if the floor gives out?\n\nCover design by Wesley Mueller.\n\nEditing by Sophie.\n\nPhysical Edition:\n\nPlease note price includes shipping ($8 zine + $5 shipping)\n\nThis is a professionally printed zine with a staple binding. 67-pages. 100 lb matte finished color cover with 70 lb satin paper inner pages.\n\n\n','https://michaelkurt.gumroad.com/l/HeavinessLeaves?layout=discover&recommended_by=search',8,3),(478,'Toxic: We\'re No Good for Each Other','https://public-files.gumroad.com/ueb9t9b7nlg65qlyfx12qcfujmwr',266,'E-BOOK | TRILOGY .. BOOK 3 OF 3','https://keenotepublishing.gumroad.com/l/bkbIuk?layout=discover&recommended_by=search',8,3),(479,'Punch Drunk','https://public-files.gumroad.com/ba49eoxyp76jdh5bdrkltits1zhx',231,'by Steven Henry','https://clickworks.gumroad.com/l/erin15?layout=discover&recommended_by=search',6,3),(480,'The Harpy Saga Anthology by S. H. Marpel','https://public-files.gumroad.com/mqb4p1g8dbev02po7g46iqdjs3my',267,'\n\n\nIt\'s not often these days that you read about a real goddess.\n\nOne who was a lover of Ulysses  and saved his butt more than he would care to admit (and never told his biographer.) And one who influenced history for good and bad in more ways than you know.\n\nBut only the very worst stories about how she looked and acted have been passed down through the ages.\n\nSo she kidnapped a writer to tell it straight. Only he had to write this as fiction, since no one would believe him anyway.\n\nThis is all about her and that author. All of what happened between them and because of them isn\'t chronicled here. But this short collection is a good start.\n\nExtracted from the numerous episodes of the Ghost Hunters series.\n\nAnd it begins, as we said above, with his disappearance...\n\nThis Anthology Containing:\n\n- Harpy\n\n- Harpy\'s Desires\n\n- Harpy Redux\n\n- Sister Mine\n\n- Time Bent\n\n- Harpy Spawn\n\nAnd a complete Book Universes Notes addition - so you know all the characters and miss no subtle asides or easter eggs...\n\nExcerpt:\n\nJOHN, YOU CAN CALL me Harpy. The voice woke me.\n\nI was tightly bound to a support column in some old, dank and stone-lined room. Where exactly, I didnt know. I had on my dungarees, work boots, red cotton t-shirt under my canvas jacket. Like Id just been air-lifted from the pasture on my farm.\n\nFacing me was a woman with wings. A gorgeous woman with strong, beautiful wings.\n\nAnd her voice was like poured honey over buttered toast on a hot day. Smooth, lustrous, golden.\n\nId rather call her siren. Especially when I looked into her eyes. Vibrant green, like the glowing color of fireflies. But steady, piercing.\n\nHarpy stepped closer to me and I could see more detail in her thin, nearly sheer top. It seemed like a dancing leotard. Her long legs took her closer to me in graceful barefoot paces. A tail of cloth-like drape, like the sweep of tail feathers behind, barely grazed the floor and raised small puffs of dust as she strode toward me.\n\nWhy Harpy, why not Siren? With a face and eyes like that, you can have any lover you want. I said.\n\nOh, and I have. They all loved me and went to their death for me. Too human. Short lifespans, inflated egos, puppy-dog eyes and utter devotion. The Harpy sighed.\n\nWhy do you call yourself Harpy, I asked. The usual pictures are of an ugly monster with really only a womans face, the rest are parts of animals.\n\nHarpy sighed. Probably the same reason vampires and other creatures have such bad reputations. You can see my wings and yes I have claws. She held up two fingers from one hand where long talons suddenly extended from her fingertips, then retracted as quickly. But that is no different than cats, really. Practically, I can even hide my wings and walk among humans, the same as Ive done for centuries. Ive passed royalty and commoner alike and no one has known except when I wanted them to. She sighed again and looked off into space.\n\nMay I ask why you brought me here and why I am tied up so tight? I asked.\n\nBecause I want you to tell my side of the story....\"\n\nScroll Up and Get Your Copy Now.\n\nAlso available at most online ebook outlets: https://books2read.com/u/47zALL','https://livingsensical.gumroad.com/l/HarpyAntho?layout=discover&recommended_by=search',3,3),(481,'Lokis - Le manuscrit du professeur Wittemb - Prosper Merimee','https://public-files.gumroad.com/blh113l4nt70hj4g1927xqwrway5',257,'Le professeur Wittembach, philosophe allemand, se rend en Lituanie pour ses recherches. Il est reu dans le chteau du comte Michel Szmioth dont la mre est devenue folle au lendemain de son mariage, aprs qu\'un ours, lors d\'une chasse, l\'eut emporte sans doute pour aller la dvorer tout  son aise dans un fourr. Le jeune comte, qui s\'est d\'abord cach dans un arbre pour observer le savant, reoit fort bien ce dernier, et lui raconte la mystification dont il a t l\'objet de la part d\'une charmante jeune fille, Ioulka Iwinska... Mrime reprend, dans cette nouvelle, la lgende de l\'homme-ours atteste dans bien des traditions, et qu\'il a pu dcouvrir dans les Danorum regum heroumque historiae de Saxo Grammaticus ou dans les Histoires tragiques de Bandello traduites par Belleforest.\n\n\n','https://bookcollections.gumroad.com/l/edxym?layout=discover&recommended_by=search',6,3),(482,'La Venus d\'Ille - Prosper Merimee','https://public-files.gumroad.com/4ey3ezppgnbprew3yhtjin5b81vb',257,'En 1857, Mrime crit  une amie : \" Avez-vous lu La Vnus d\'Ille, une histoire de revenants que j\'ai faite ? C\'est, selon moi, mon chef-d\'uvre. \"\nCette Vnus de bronze d\'une beaut foudroyante aux yeux incrusts d\'argent, il l\'invente avec des lgendes mdivales et des souvenirs de ses tournes archologiques dans le Roussillon.\nLe jour de son mariage, un jeune homme ivre et dsinvolte glisse au doigt de la statue la bague destine  sa fiance. Au matin de la nuit de noces, on le retrouve mort, aprs, semble-t-il, une agonie d\'pouvante.\nDe l\'trange au merveilleux, du bizarre au fantastique, on ne saura jamais comment la froce statue nous entrane dans son mystre. C\'est l\'art de Mrime, la magie de son style glacial, ironique, parfaitement invisible.','https://bookcollections.gumroad.com/l/myuzow?layout=discover&recommended_by=search',6,3),(483,'Il Viccolo di Madama Lucrezia - Prosper Merimee','https://public-files.gumroad.com/bwc09dneelii7jtze2wds4juy9zs',257,'Il Viccolo di Madama Lucrezia\nProsper Mrime, crivain, historien et archologue franais (1803-1870)Ce livre numrique prsente Il Viccolo di Madama Lucrezia, de Prosper Mrime, dit en texte intgral. Une table des matires dynamique permet d\'accder directement aux diffrentes sections.Table des Matires\n-01- Prsentation\n-02- Il Viccolo di Madama Lucrezia','https://bookcollections.gumroad.com/l/pbsws?layout=discover&recommended_by=search',6,3),(484,'Colomba - Prosper Merimee','https://public-files.gumroad.com/o38pmrqq7fgp9y3g4jbqfapmlgkm',257,'Prosper Mrime (1803-1870) was an author by hobby, not necessity, being the son of two talented and highly successful artists. He was also a lawyer, a public official, a senator, a painter, an authority on Russian literature and a member of the French Academy. As a public official, Mrime travelled through France and Europe, from which he drew inspiration for his stories and novels. His first popular novella, \"Colomba\", was published in 1840. It is set in Corsica, and tells the story of the della Rebbia family, whose father has been murdered in an ambush, believed by his daughter to have been perpetrated by the town\'s mayor, Lawyer Barricini. She implores her brother, Lieutenant Orso della Rebbia, to avenge their father\'s death, but Orso does not share her passionate ancestral pride. His heart is torn between personal vendetta and a propensity to abide by the law.','https://bookcollections.gumroad.com/l/zzuqh?layout=discover&recommended_by=search',6,3),(485,'Chronique du regne de Charles IX - Prosper Merimee','https://public-files.gumroad.com/4wflqnzaaj5ng1c8x74trr3xmsqs',257,'Chronique du rgne de Charles IX\nProsper MrimeTexte intgral. Cet ouvrage a fait l\'objet d\'un vritable travail en vue d\'une dition numrique. Un travail typographique le rend facile et agrable  lire.\nLe roi que tout le monde a oubli... et pour cause : Il a tout rat sauf sa fin  la veille de ses 24 ans !\nCharles IX succda  son frre Franois II qui n\'avait rgn que quelques mois. Il monta sur le trne  un ge encore plus prcoce : dix ans. Sa mre qui continua l\'exercice du pouvoir. Charles IX tait tout aussi fragile physiquement et psychologiquement que ses frres. Il tait inconstant, tantt sous l\'influence de sa mre, tantt sous celle de Coligny.\nEn 1570, sa mre mit fin  la troisime guerre de religion en lui faisant signer la paix de Saint-Germain qui accordait la libert de culte aux protestants, ainsi que plusieurs places fortes, dont La Rochelle. Il se lia peu  peu d\'amiti avec Coligny qui en profita pour le convaincre de relancer la guerre des Flandres, dans laquelle la France devait porter secours aux protestants contre l\'intolrance du pouvoir espagnol. Sa mre qu\'une guerre ouverte avec l\'Espagne inquitait, dcida avec l\'aide des Guise l\'limination de Coligny. Mais l\'attentat rata. Affole par les consquences de ce ratage, alors que Paris hbergeait un grand nombre de protestants venus assister au mariage d\'Henri de Navarre, Catherine, avec l\'aide de son autre fils Henri, convainquit Charles IX de l\'limination de tous les chefs protestants. Ce massacre qui eut lieu lors de la Saint-Barthlemy 1572 s\'emballa avec la participation de tout le peuple et s\'tandit  toute la France.\nTout au long de son rgne, il souffrit de la prfrence de sa mre pour son frre Henri. Il se rjouit lorsque celui-ci dut partir aprs son lection au trne de Pologne (1573). Mais malade, il mourut  la veille de ses 24 ans. Il fut remplac par son frre Henri, le duc d\'Anjou et bref roi de Pologne.','https://bookcollections.gumroad.com/l/bbxrn?layout=discover&recommended_by=search',6,3),(486,'Rocambole - La corde du pendu - Tome I - Pierre Ponson du Terrail','https://public-files.gumroad.com/bvcun8zs9akoeu2rprxc35mtgqhm',257,'Pierre Alexis Ponson du Terrail (1829-1871)\n\n\n\n\n\"Lcroulement du souterrain durait toujours.\n\nLa vote de la galerie se dtachait par fragments de blocs normes.\n\nLe sol continuait  mugir et  trembler.\n\nOn et dit un de ces tremblements de terre qui branlent les cits du nouveau monde.\n\nVanda tait tombe  genoux et priait.\n\nPauline, suspendue au cou de Polyte, lui disait :\n\n Au moins, nous mourrons ensemble !\n\nMilon hurlait de fureur et brandissait ses poings normes en rptant :\n\n Ah ! les gredins de fenians ! les propres  rien ! les canailles !\n\nMarmouset, lui, regardait le matre.\n\nLe matre tait calme, debout, le front haut.\n\nIl semblait attendre la fin de ce cataclysme avec la tranquillit dun homme qui se sait au-dessus de la mort.\"\n\n\n\n\n\nSuite de \"Les dmolitions de Paris\"\n\nDernire aventure de Rocambole crite par Pierre Alexis Ponson du Terrail.','https://bookcollections.gumroad.com/l/rmwxt?layout=discover&recommended_by=search',6,3),(487,'Rocambole - En prison - Pierre Ponson du Terrail','https://public-files.gumroad.com/fpwk0862bm1jrskrpzm8plq8upgr',257,'Enfin un hros dtestable. Ce feuilletonnesque roman ne peut faillir  l\'horrible rputation : meurtres, trahisons, vol, perfidies, tout le parcours de l\'ignominie est au rendez-vous de ce chef d\'uvre.\n\n\n\n\n\n\n','https://bookcollections.gumroad.com/l/wrati?layout=discover&recommended_by=search',6,3),(488,'Le Dernier mot de Rocambole - Tome IV - Pierre Ponson du Terrail','https://public-files.gumroad.com/p96w3vuegndszamc9kk0fao4coii',257,'Depuis deux ans, Rocambole arpente l\'Inde, seul et en plein cur du territoire ennemi. Il a vu Moussami, son fidle ami indien, se faire couper la langue, il a entendu les balles siffler prs de son oreille et a senti les griffes d\'une panthre pntrer sa chair. Mais, alors que sir Edward Linton est sur le point de tuer le rajah Osmany, un alli de poids se joint  la lutte de Rocambole: Nadir, un membre des Fils de Sivah, dornavant fidle  Rocambole pour avoir livr Ali-Remjeh, son plus mortel ennemi,  la police britannique. Dans le quatrime tome du Dernier Mot de Rocambole, Rocambole est  la merci des malfrats, et il aura besoin, plus que jamais, de faire confiance  ses amis s\'il veut s\'en sortir vivant. Pierre Alexis Ponson du Terrail (1829-1871) est un crivain populaire franais. Il a crit plus de deux cents romans en vingt ans. Il est surtout connu pour son personnage Rocambole, qui par la suite a donn l\'adjectif rocambolesque. Destin  une carrire navale, il prfre se ddier  la littrature. En 1857, il commence l\'criture de son personnage phare dans l\'Hritage mystrieux qui connatra un grand succs.\n\n\n','https://bookcollections.gumroad.com/l/mxuijv?layout=discover&recommended_by=search',6,3),(489,'Le Dernier mot de Rocambole - Tome II - Pierre Ponson du Terrail','https://public-files.gumroad.com/qhwdgp9xttalo9jhz6cr7sakjj1a',257,'Rocambole a pris un accent londonien depuis son voyage dans la capitale anglaise aux cts de Milon, Vanda et quelques repentis des Ravageurs. Tous se sont jurs de faire le bien face  la secte des Thugs, qui enlve sans relche de jeunes femmes innocentes pour les remettre  la desse Kali, aux Indes... Rocambole est dtermin  les protger ; en particulier la gentille bohmienne, Anna, spolie de son hritage par sa tante Milady, matresse d\'un criminel d\'orient. Dans le second tome du Dernier mot de Rocambole, notre hro Rocambole dont la rputation n\'est plus  faire, devra se la jouer cosmopolite s\'il veut djouer les plans de ses ennemis. Sa seconde tape: l\'Inde. Pierre Alexis Ponson du Terrail (1829-1871) est un crivain populaire franais. Il a crit plus de deux cents romans en vingt ans. Il est surtout connu pour son personnage Rocambole, qui par la suite a donn l\'adjectif rocambolesque. Destin  une carrire navale, il prfre se ddier  la littrature. En 1857, il commence l\'criture de son personnage phare dans l\'Hritage mystrieux qui connatra un grand succs.\n\n\n','https://bookcollections.gumroad.com/l/srcomh?layout=discover&recommended_by=search',6,3),(490,'Le Dernier mot de Rocambole - Tome I - Pierre Ponson du Terrail','https://public-files.gumroad.com/8v6lbkz3hjymfwd39xmlhk1aw05j',257,'La nuit, Paris est si sombre que l\'on confond un homme avec un lampadaire teint ; un cadavre avec Rocambole. Aprs son combat contre la comtesse Vasilika, on l\'avait cru mort. Mais aujourd\'hui, il a t retrouv prs de la Seine, inconscient, par une bande de malfrats qu\'on appelle les Ravageurs. Alors que Rocambole est en convalescence, il lutte face  leur chef, Ptissier, un fainant aux valeurs trop loignes de Rocambole. Mais ce n\'est l qu\'un point de dpart pour notre hro: la secte des Thugs sme la terreur en Europe. Ses membres cherchent  enlever de jeunes vierges, envoyes  la desse Kli aux Indes... Dans ce premier tome du Dernier Mot de Rocambole, Rocambole, bien vivant et dornavant repenti, devra voyager jusqu\' Londres s\'il veut faire rgner le bien. Pierre Alexis Ponson du Terrail renouvelle l\'un des romans feuilletons le plus iconique, aux pripties inoubliables. Pierre Alexis Ponson du Terrail (1829-1871) est un crivain populaire franais. Il a crit plus de deux cents romans en vingt ans. Il est surtout connu pour son personnage Rocambole, qui par la suite a donn l\'adjectif rocambolesque. Destin  une carrire navale, il prfre se ddier  la littrature. En 1857, il commence l\'criture de son personnage phare dans l\'Hritage mystrieux qui connatra un grand succs.\n\n\n','https://bookcollections.gumroad.com/l/bpprtq?layout=discover&recommended_by=search',6,3),(491,'La Femme immortelle - Pierre Ponson du Terrail','https://public-files.gumroad.com/qcqwx6h0vcuprnseogcdflzzvn45',257,'Vampire, vous avez dit vampire ? Une belle histoire  rebondissements qui se lit en feuilleton. L\'histoire de Janine et de son jeune amant chass par l\'amour de vieux prtendants pris de remords  l\'poque du Rgent Philippe d\'Orlans.\n\n\n\n\n\n\n','https://bookcollections.gumroad.com/l/nfuwr?layout=discover&recommended_by=search',6,3),(492,'Un mousse de Surcouf - Pierre Mael','https://public-files.gumroad.com/dwry7u869wa8yimb5s42u3jdpxu9',257,'Extrait : \"Le 4 vendmiaire au VII, c\'est--dire le 25 septembre 1799, le trois-mts la Bretagne sortait du port de Brest et gagnait la mer, toutes les voiles dehors. C\'tait un beau navire de commerce qui transportait des migrants vers l\'Amrique. On mourait de faim en Bretagne, comme un peu partout d\'ailleurs en France, et cette migration-l ne ressemblait point  celle que les lois encore en vigueur punissaient de mort.\"\n\n PROPOS DES DITIONS LIGARAN\n\nLes ditions LIGARAN proposent des versions numriques de qualit de grands livres de la littrature classique mais galement des livres rares en partenariat avec la BNF. Beaucoup de soins sont apports  ces versions ebook pour viter les fautes que l\'on trouve trop souvent dans des versions numriques de ces textes.\n\nLIGARAN propose des grands classiques dans les domaines suivants :\n\n Livres rares\n Livres libertins\n Livres d\'Histoire\n Posies\n Premire guerre mondiale\n Jeunesse\n Policier','https://bookcollections.gumroad.com/l/vmtrib?layout=discover&recommended_by=search',6,3),(493,'Les chansons de Bilitis - Pierre Felix Louis','https://public-files.gumroad.com/t9egov9es4bnj4g6746ie5ylx01x',257,'Les Chansons de Bilitis sont sans ge. Elles sont grecques parce que la Grce est le pays de la Beaut et que cette Beaut claire l\'Amour d\'une lumire pure et mystrieuse... C\'est le jardin d\'Eden, son innocence... ses faiblesses, aussi.\n\nMais aux paules de Bilitis battent doucement les ailes de la posie qui, dans un long nimbe aux couleurs changeantes, lui font traverser cette toute petite tragdie du temps qui passe et tout emporte, dans le souffle tide de l\'Amour qui, lui, demeure et toujours parl au cur des cratures...\n\n\'Dans l\'ombre des forts profondes, dans la poudre lgre des rues de Mytilne et les nuits moites de Chypre, Bilitis rit et pleure, et aime, dans l\'impatience des premiers ges, dans la triste mlancolie du temps si vite enfui... Les corps sont des courbes, la Beaut est intemporelle, l\'Amour est une chanson, et qu\'importent la main qui tient la plume, l\'poque ni la langue, la corde vibre et la musique nous emporte.','https://bookcollections.gumroad.com/l/hbjykc?layout=discover&recommended_by=search',6,3),(494,'Melite - Pierre Corneille','https://public-files.gumroad.com/lf8qh6hzqofi3atfmvq2erq6psjs',257,'Mlite, ou les fausses lettres est une comdie en cinq actes et en vers crite par Pierre Corneille en 1625 reprsente pour la premire fois en dcembre 1629 au Jeu de paume de Berthaud par la troupe de Montdory. Avec cette pice, Corneille cre un nouveau genre thtral, la comdie de moeurs, qui rompt avec la farce grossire et bouffonne en vogue  l\'poque.Comdie: raste, amoureux de Mlite, la fait connatre  son ami Tircis, et, devenu peu aprs jaloux de leur hantise, fait rendre des lettres d\'amour supposes, de la...','https://bookcollections.gumroad.com/l/afgrw?layout=discover&recommended_by=search',6,3),(495,'Medee - Pierre Corneille','https://public-files.gumroad.com/29qz7ncehoycc8ze07p2kcx3wvuy',257,'Pour chaque titre de gloire du hros Jason, son pouse Mde a commis un crime. Pour lui, elle a trahi son pays, tu son frre et pouss des jeunes filles  assassiner leur pre. Le couple vit en exil  Corinthe avec ses deux fils, jusqu ce que Jason sprenne de la fille du roi. Quil lpouse, et il hritera du trne. Mde, elle, sera bannie du royaume. Mais la femme rpudie est une magicienne, experte en poisons comme en sorcellerie. Meurtrie dans sa fiert autant que dans son amour, Mde va user de tout son art pour frapper dans sa chair linfidle Jason. Objets magiques, rebondissements, effets de scne spectaculaires : pour la premire tragdie de sa carrire, Corneille transpose le mythe grec de Mde dans lesthtique baroque. En insistant sur la puissance et sur laura infernale de son hrone, lauteur du Cid fait du rcit de sa vengeance une forme dapothose du mal.\n\n\n','https://bookcollections.gumroad.com/l/wknst?layout=discover&recommended_by=search',6,3),(496,'La Veuve - Pierre Corneille','https://public-files.gumroad.com/mh1roa66tm3o36y6yvs8og6fhfnl',257,'Comdie : Alcidon, amoureux de Clarice, veuve d\'Alcandre et matresse de Philiste, son particulier ami, de peur qu\'il ne s\'en apert, feint d\'aimer sa soeur Doris, qui, ne s\'abusant point par ses caresses, consent au mariage de Florange, que sa mre lui propose. Ce faux ami, sous un prtexte de se venger de l\'affront que lui faisait ce mariage, fait consentir Clidan  enlever Clarice en sa faveur...\n\n\n','https://bookcollections.gumroad.com/l/pfieb?layout=discover&recommended_by=search',6,3),(497,'La suivante - Pierre Corneille','https://public-files.gumroad.com/oud3m8qz0ac0ricc6trc8s7heg1a',257,'M. Margitic suit dans cette dition le principe de publier les textes de Corneille d\'aprs l\'dition princeps. Ce principe s\'avre fructueux et intressant surtout pour les premires pices de Corneille, qui ont t beaucoup remanies par la suite: la Suivante est de celles-l.\n\n\n\n\n\n\n','https://bookcollections.gumroad.com/l/mujdb?layout=discover&recommended_by=search',6,3),(498,'La Place Royale ou L\'amoureux extravagant - Pierre Corneille','https://public-files.gumroad.com/03t3zok0t2lb6c3q9p2jotu1aeix',257,'Comdie : Phylis fait bon accueil  tous les galants. Anglique, elle, ne veut aimer qu\'Alidor. Celui-ci, dsireux de sortir de l\'tat de dpendance o le mettent ses sentiments  l\'gard d\'Anglique, dcide de rompre. Il la cde  son ami Clandre, amoureux d\'elle bien qu\'il feigne d\'aimer Phylis. Aprs avoir lu la lettre, prtendument adresse  une autre, qu\'Alidor lui a fait parvenir, Anglique l\'accable de reproches et, loin de nier, il se montre blessant. Par dpit, elle accepte d\'pouser Doraste, le frre de Phylis...\n\n\n','https://bookcollections.gumroad.com/l/pxuodv?layout=discover&recommended_by=search',6,3),(499,'La Galerie du Palais - Pierre Corneille','https://public-files.gumroad.com/jsga4vtz6rapo26tk9vdxahnal68',257,'Comdie : Dorimant aime Hippolite, qui aime Lisandre, qui aime Clide, qui hsite entre Dorimant et Lisandre. Aussi Clide dcide-t-elle,  la stupfaction d\'Hippolite, d\'prouver son amant par quelques froideurs. Dsespoir de Lisandre. Son cuyer, Aronte, gagn  la cause d\'Hippolite, lui suggre de feindre d\'aimer ailleurs pour veiller la jalousie de Clide...\n\n\n','https://bookcollections.gumroad.com/l/rpqqy?layout=discover&recommended_by=search',6,3),(500,'L\'Illusion Comique - Pierre Corneille','https://public-files.gumroad.com/jv2e7505x5uxz8vllavnl5codq02',257,'La scne est quelque part en Touraine, dans la grotte du magicien Alcandre, qu\'un pre vient consulter sur le sort de son fils disparu. La grotte se mtamorphose alors en thtre et le jeune homme apparat, sous l\'habit de comdien, en serviteur rus du bouillant capitaine Matamore... La fantasmagorie commence, pice follement originale toute en reflets et jeux de miroir que Corneille lui-mme qualifiait d\'\" trange monstre \" et d\'\" extravagante galanterie \".\n\nAprs quelques comdies  succs, l\'avocat rouennais crit le chef-d\'uvre de sa priode baroque. Depuis cette anne 1636, L\'Illusion comique rsume en deux heures tout le mystre et tout le miracle du thtre, sa magie et ses artifices. Entre la farce et le drame, la ralit et la ferie, elle en rvle toute la mcanique motionnelle dans un climat de rve et d\'clatante posie.','https://bookcollections.gumroad.com/l/nnfzf?layout=discover&recommended_by=search',6,3),(501,'Le livre de la blaise - Philippe Monnier','https://public-files.gumroad.com/jyf789ytvrnfh1rpprzp0ullk34v',257,'Blaise, un original et pote marginal qui, en se souvenant de son enfance et de ses annes dcolier, fait un pangyrique ironique et attendri, peut-tre un brin chauvin, du collge public de Genve, le Collge Calvin, institution qui a form des gnrations de garons, devenus lites masculines de la  Rpublique et Canton de Genve . Ses souvenirs nous voquent parfois Titeuf ou le petit Nicolas. Il fait tour  tour lloge des  gattes  (lcole buissonnire) qui, autant que lcole, trouve-t-il, permettent un...','https://bookcollections.gumroad.com/l/bnjxkw?layout=discover&recommended_by=search',6,3),(502,'Quatre femmes et un homme - Paul Feval (pere)','https://public-files.gumroad.com/xhgbw1ly27w43c5l2fwdi07a5etd',257,'Cinq histoires courtes sur le thme de l\'amour et des sentiments (mise en scne, fraternit, convoitise, dvouement,...)\n\n\n','https://bookcollections.gumroad.com/l/dqgfb?layout=discover&recommended_by=search',6,3),(503,'Le Docteur Mystere - Paul d\' Ivoi','https://public-files.gumroad.com/wzkcs4dfi4h4tgyp2f4o78ylgt8t',257,'Le docteur Mystre poursuit une oeuvre grandiose de libration de l\'Inde, de la double tutelle des Anglais et des brahmanes. Il est aid dans sa tche par un jeune franais, Cigale, et une ravissante jeune fille. Les brahmanes, machiavliques hindous, utilisent tous les moyens pour parvenir  leurs fins : vol, mensonge, trahison, enlvements, etc. Mais notre hros dispose de moyens scientifiques tonnants pour les combattre...','https://bookcollections.gumroad.com/l/xdaga?layout=discover&recommended_by=search',6,3);
